ion.php on line 175
Error - 2014-06-04 15:01:48 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('364543737', 'JP', 'com.intsig.camcard.ja2', 'CamCard - 名刺認識管理', 'http://a178.phobos.apple.com/us/r30/Purple4/v4/51/17/bd/5117bd3b-c2bf-0b4f-7e5a-a98edbce01f4/mzl.hvzgddze.53x53-50.png', 'http://a1046.phobos.apple.com/us/r30/Purple4/v4/51/17/bd/5117bd3b-c2bf-0b4f-7e5a-a98edbce01f4/mzl.hvzgddze.75x75-65.png', 'http://a595.phobos.apple.com/us/r30/Purple4/v4/51/17/bd/5117bd3b-c2bf-0b4f-7e5a-a98edbce01f4/mzl.hvzgddze.100x100-75.png', '100.00000', 'JPY', 'IntSig Information Co.,Ltd', 'iOS_Apps', '6000', 'toppaidapplications', 0, 'バレンタインデーのタイムサービス　―　90％オフ！ \n\n*　全世界ダウンロード数最多の名刺管理アプリ！\n*　全世界5000万人以上のエリートビジネスマンが使用！\n* App Store 2011、2012年度ナンバーワンビジネスアプリケーション\n* 「CamCardはスマートフォン時代に我々が如何に連絡先情報の保存と共有をすべきかを教えてくれるベストモデル」——BBC\n* 「CamCardは文句なしに名刺認識アプリのナンバーワン！」――ニューヨーク•タイムズ紙\n* 「一瞬で営業情報を保存、営業担当必須のアプリ」——Inc.\n* 「大量の名刺を一気に携帯電話に入力、とても簡単！」——CBS\n\n\nCamCardは最もプロフェッショナルな名刺認識・管理アプリです。様々な言語の名刺を迅速かつ正確に認識し、自動でアドレス帳に保存。また、名刺に画像、ビデオを追加することで個人、製品、会社を全方位から紹介できます。さらに、オンタイムで更新可能な人脈バンクは、顧客訪問や顧客リレーションの管理に役立ちます。\n\n\n\n-------特別なコア技術、世界最先端-------\n*  携帯電話で名刺を撮影、情報は一瞬でアドレス帳に登録\n*  名刺にイメージ、画像、ビデオ、SNSアカウントを追加\n*  オンタイム更新の人脈バンクで連絡先の状態を把握\n*  顧客訪問や顧客リレーション管理に役立つ\n\n\n\nサポートシステム：\niPhone 3GS, iPhone 4, iPhone 4S, iPhone 5, iPhone 5s, iPhone 5c, iPod Touch 5, iPad(Retina), iPad mini\n\n\n-------機能説明-------\n\n【名刺認識】\n携帯電話で名刺を撮影、情報は一瞬でアドレス帳に登録\n複数名刺を撮影し、まとめて認識\n16種類の言語の名刺、QRコード名刺、メール署名名刺の認識をサポート\n\n\n【名刺交換】\nQRコードの撮影や「同時タップ」で瞬時に名刺を交換、名刺情報を気軽にシェア\n\n\n【クラウドサービス】\nアカウント登録で全ての名刺をクラウドに保存し、永久管理。携帯電話、タブレット、パソコンでいつでも名刺情報を確認。人脈管理は更に安全・便利に。\n\n\n【プロフィール】\nビジネス情報を表示する個人ホームページ。名刺、画像、音声、ビデオ、SNSアカウントを追加し、個人、製品、会社を全方位から紹介。相手に深い印象を残し、製品と会社への理解も深まります。\n\n\n【更に強力な名刺CRM】\n名刺撮影とアドレス帳登録に加え、名刺に文字、画像も追加可能、誕生日や訪問などのリマインドも設定でき、交渉と面会のプロセスをスマートに記録。地図で名刺の住所を位置付けや該当住所の付近の連絡先も確認でき、訪問ルートとビジネス日程管理が簡単に。人脈バンクの管理も更にスマートに！\n\n\n【高精度校正】\n高精度校正に送信すると、迅速に100%の名刺認識結果をフィードバック。高精度校正は、人工知能技術で名刺画像を認識し、必要に応じて、人的校正も実施。\n\n\n名刺認識管理(CamCard)を気に入っていただけましたら、或いはご意見がございましたら、少しお時間をいただき、名刺認識管理(CamCard)のご評価或いはisupport@intsig.comまでご連絡をお願いします。商品の改善へのご協力により更に多くの優れた機能を体験していただけますよう努力して参ります。\n\n\n\n-------アドバイス-------\n弊社製品ご使用の際に、よりよい効果を得るため：\n*画像が鮮明であればそれだけ認識精度も高まります。「明るい場所で、極力手ぶれの少ない状態で撮影してください」\n*画像が大きければそれだけ認識精度も高まります。「撮影する際には画像が大きくディスプレイに表示されるようにしてください」\n\n\n\n-------弊社の他のアプリケーション-------\n\n\n\n------- CamScanner \n\n\n* App Store2011年度セールスナンバー１アプリケーション\n* App Store2012年度セールスナンバー１有料アプリケーション\n* 全世界6000万人以上のユーザー、3000以上の教育機関、200以上の国・地域で使用されるスキャンアプリ！\n* ｢CamScannerは特別な画像処理技術でドキュメントがより読みやすくなる｣—Makeuseof.com\n* ｢間違いなくCamScannerは携帯電話で一番のスキャナーアプリ｣—CNET.com\n* iPhoneトップ50アプリの一つ―アメリカ「タイム」\n\n\n\n-------CamDictionary\n*  App Store2011年度ナンバーワン人気辞書/辞典アプリケーション\n*  App Store 2012年度ナンバーワン有料アプリケーション', '2010-04-06 20:57:23', '2014-06-04 15:01:48')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:01:51 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('547162979', 'JP', 'mobi.byss.instaweather', 'InstaWeather Pro', 'http://a504.phobos.apple.com/us/r30/Purple4/v4/00/f3/b8/00f3b80a-63ee-9c41-908d-30ab6f29eb94/mzl.hprvphpu.53x53-50.png', 'http://a1020.phobos.apple.com/us/r30/Purple4/v4/00/f3/b8/00f3b80a-63ee-9c41-908d-30ab6f29eb94/mzl.hprvphpu.75x75-65.png', 'http://a1625.phobos.apple.com/us/r30/Purple4/v4/00/f3/b8/00f3b80a-63ee-9c41-908d-30ab6f29eb94/mzl.hprvphpu.100x100-75.png', '100.00000', 'JPY', 'byss mobile', 'iOS_Apps', '6001', 'toppaidapplications', 0, '*** SALE *** LIMITED TIME *** 50% OFF *** VIDEO MODE \n\nこのアプリは、従来までのつまらないお天気予報アプリとは違います ;)! \nこれは、アメリカ、日本、中国、イギリス、ブラジル、イタリアなど、100カ国でナンバーワンのお天気アプリです。\nダウンロード数がすでに一千万回突破しています！ \n本製品の利用者のご意見を確認してください：\n- インスタグラムの画像をほかの段階に移行させたい方には、これはまさにぴったりのアプリです。　Makeusof.com をご覧下さい。 \n- 「InstaWeather‐雨や、太陽の光を満喫できる－ソーシャルサイド」　macworld.co.uk \n- InstaWeatherは、トラベルショットを投稿するのに優れており、お客様の景色をフォロアにも楽しんでもらうことができ、また現在地の寒暖も伝えることができます。 Bestappsite.com \n- apponlinereview.com の天気予報 Mrtaylor3234を自己流にアレンジするのに最適です。 \n- シンプルな発想、鮮明なレイアウト－情報を伝える新しい方法です。\n宣伝広告は表示されません！ アプリ内にはありません! \n作動方法 \nInstaWeatherを使って、お好きなiPhoneのフォト上に現在地のお天気や予報を表示できます。 \n•次に、お友達にお天気を伝えます－感動的でインフォーマティブな画像を使って、素早く簡単に伝えることが可能です。\n•現在地の現在の温度や簡潔な情報から、気圧、温度、雨、風力、風向等の詳細な予報まで、60種類以上の様々なスキンにアクセスできます。\n•また、表示される天気予報の期間も、「今日」、「2日間」、「１週間」と選択できま す。　そして、セ氏、カ氏、キロメーター、マイルで表示できます。　そして、以下の27カ国語でのご利用が可能です：中国語(簡体字と繁体字)、スペイン語、フィンランド語、フラン ス語、ヘブライ語、クロアチア語、ハンガリー語、インドネシア語、イタリア語、アラビア語、カタロニア語、チェコ語、デンマーク語、日本語、朝鮮語、マラ イ語、オランダ語、ノルウェー語、ポーランド語、ポルトガル語、ロシア語、スウェーデン語、タイ語、トルコ語、ベトナム語、ドイツ語。 \n•また、テキストの編集機能を使って、お客様自身のコメントを追加したり、InstaWeather フォトを自己流にアレンジできます。\n•どんなところからでも、以下のサイトで共有できます：フェイスブック、ツイッター、インスタグラム、フォースクウェア。　また、SMSまたは電子メールで送信できます。 \nインスタウェザー・アプリをインストールして、友達にお天気を伝えましょう。 いつでも好天を楽しむことができます！ \nPROバーションを取得しますか。 \n•PRO では、スキンの数が豊富です。 \n•PRO では、最新のスキンを１、２週間（それ以上）にすることができます。 \n•PRO は、潮位表のスイッチをオフにできます。 \n•PRO バージョンでは、オプションの数も豊富です \n•PRO では、バナー広告が表示されません \n•PROでは、 InstaWeatherの最新バージョンを提供します:)　そしてお客様もプロになれます。', '2012-09-20 05:45:02', '2014-06-04 15:01:51')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:01:53 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('415468221', 'JP', 'com.gmail.shibuym.ContactsBook', '連絡先＋', 'http://a279.phobos.apple.com/us/r30/Purple6/v4/cd/95/20/cd95203c-bc4e-033d-e60e-384f8c21f626/mzl.zztmxfny.53x53-50.png', 'http://a1147.phobos.apple.com/us/r30/Purple6/v4/cd/95/20/cd95203c-bc4e-033d-e60e-384f8c21f626/mzl.zztmxfny.75x75-65.png', 'http://a312.phobos.apple.com/us/r30/Purple6/v4/cd/95/20/cd95203c-bc4e-033d-e60e-384f8c21f626/mzl.zztmxfny.100x100-75.png', '100.00000', 'JPY', 'SHIBUYA Masanori', 'iOS_Apps', '6002', 'toppaidapplications', 0, '「連絡先+」は、連絡先のグループ分けやメールの一斉送信ができるアドレス帳アプリです。\nタブとドラッグ&ドロップで簡単に連絡先を整理できます。\n\n◆AppStore Best of 2013 有料総合9位になりました。\n◆ランキング獲得　AppStore 2012年年間有料総合4位、2011年年間有料総合9位、iPhone有料総合2位、カテゴリ1位、オールタイムトップ25 14位\n◆iOS 7に対応 \n\n連絡先＋の使い方\n\n・グループを作成する\n　アプリケーションを起動すると、右側にタブが並んでいます。グループを作成するためには、その下の「+」ボタンを押してください。\n\n・連絡先をグループに追加する\n　連絡先を「ドラッグ&ドロップ」でグループに分類します。\n\n　[ドラッグ&ドロップの方法]\n　　移動したい連絡先を長押しします。連絡先が浮かびあがったら、グループの「タブ」の上まで動かして指を離してください。\n\n・メールを一斉送信する\n　グループを選択して、メールボタンを押してください。メールアドレスをタップして「To(送信する)」/「×(送信しない)」 を切替えてください。\n\n・連絡先リストを整理する\n　連絡先には、会社名や写真を表示できます。\n連絡先は通常は名前の順に並びますが、会社名/色/登録日/誕生日の順で並べたり、任意の順序に並べることができます。\nまた、連絡先に目印として色をつけることができます。\n\n・連絡先を検索する\n氏名、会社名、メモ、電話番号、メールアドレス、住所、ニックネームで検索できます。\n\n・編集モード\n　編集モードでは、複数の連絡先をまとめてグループ分けできます。\n\n　[複数の連絡先をまとめてドラッグ&ドロップ]\n　「編集」ボタンを押し、移動したい連絡先をタップしてチェックマークをつけた後、連絡先をドラッグしてください。\n\n・その他の機能\n -Sparrow、デコメーラー、ibisMailでグループメール送信 \n -050 plus、050 plus for Biz、AGEphone、Acrobits Softphone、SMARTalkで電話発信 \n -複数の連絡先をまとめて送信 \n -プレフィックス機能\n　184、186のような番号をつけて電話を発信できます。プレフィックスの種類は自由に追加できます。\n\n◆お知らせ\n\n※「連絡先＋」は、純正の「連絡先」を参照して表示しています。「連絡先＋」のアップデートでデータが消去されることはありませんが、何かの問題で純正の連絡先アプリのデータが消えると「連絡先＋」からも消えてしまいます。iOSアップデートや同期の問題で連絡先が消えてしまう事例がありますので、iTunes/iCloudでバックアップして頂くようお願いします。「連絡先＋」を使って簡単にメールでバックアップできますので併せてご利用ください。\n\n※auのiPhoneをお使いの場合、連絡先のデフォルトアカウントが「◎Eメール(ezweb.ne.jp)」になっていないことをご確認ください。グループ分けができない、連絡先が消えるなどの問題の原因となります。お問い合わせ頂くトラブルの多くはこれが原因です。詳細は「メールアプリでのEメール(@ezweb.ne.jp)利用設定」STEP3をご確認ください。\nhttp://www.au.kddi.com/iphone/support/guide/1.html\n\n※連絡先が消えるなどお困りのことがあれば、設定＞問い合わせ からお問い合わせください。AppStoreのレビューには回答ができません。\n\n◆注意事項\n\n※このアプリを使っての連絡先、グループの変更はiPhone標準の連絡先に反映されます。グループのアイコン/色/順序、連絡先の色/順序はこのアプリ独自の機能のため標準連絡先には反映されません。\n\n※Exchangeを使って同期している連絡先をグループ分けするには「ローカルグループ」を使用してください。ローカルグループはiPhone標準連絡先に反映されません。\n\n※ローカルグループは、グループと連絡先の関連づけに氏名と会社名を使用しています。そのため、氏名／会社名が完全に一致した連絡先が複数ある場合、グループ分けが正しく動作しない場合があります。\n\n※OSの制限により、カスタム着信音の設定には対応しておりません。\n\n※iOS6ではFacebookの友達が自動的に連絡先に追加されます。これを解除するためには、設定>Facebook>アカウントの使用を許可するApp:連絡先をオフにしてください。', '2011-02-20 10:34:58', '2014-06-04 15:01:53')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:01:59 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('382069612', 'JP', 'se.resenatverket.FlightRadar24', 'Flightradar24 Pro', 'http://a158.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.53x53-50.png', 'http://a1026.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.75x75-65.png', 'http://a1983.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.100x100-75.png', '300.00000', 'JPY', 'Flightradar24 AB', 'iOS_Apps', '6003', 'toppaidapplications', 0, 'あなたの携帯やiPadをエアートラフィックレーダーに変えて、日本の周りや世界中を飛ぶ飛行機をリアルタイムで詳細な地図上で見てみましょう。アップル機器を空を飛んでいる飛行機にかざして、行き先その他を調べましょう。何百万人ものひとがなぜ Flightradar24を愛用しているのか。今日、ご自分で体験してみませんか。\n\nFlightradar2 アプリが25カ国以上でベストセラーとなった、また140カ国以上 (日本、米国、英国、ドイツその他) でベストセラーの旅行アプリとなった優れた機能には以下があります: \n* 詳細な地図上を飛行機が移動するのをリアルタイムでご覧になれます\n* 機器を空にかざすだけで、上空を飛んでいる飛行機を識別できます (GPS 搭載の機器が必要です)\n* 飛行機のパイロットがなにを見ているか、リアルタイムで 3Dで体験できます (iPhone 4S, iPad 2, iPod Touch 第5世代、+ iOS 6.0 以降のバージョンが必要となります)\n* 飛行機をタップすると、ルートや予想到着時間、実際の離陸時間、機種、速度、高度や高解像度の画像といった、全体的なフライトと機体の情報が表示されます\n* 便名や空港、航空会社で、個別のフライトを簡単に探せます\n* 航空会社、期待、高度、速度その他で簡単にフィルタリングできます\n* 簡単にお気に入りに追加でき、関心のある地域を迅速にナビゲーションできます\n* 機器を主要な航空の発着案内に合わせると、リアルタイムでフライトステータス更新と、現在の空港周辺の天候条件を見ることがをできます (アプリ内で別途ご購入いただいた場合)\n* リアリスティックな機体の記号 (アプリ内で別途ご購入\n* 航空会社、機種、便名または登録に基づいたカスタマイズされたアラートを設定する(アプリ内で別途ご購入) \n\nどのように機能するか\n今日、ほとんどの機体には、いわゆる位置データを送信する、いわゆるADS-Bのトランスポンダーが搭載されています。Flightradar24 は急成長中のネットワークで、世界中に数千のグループステーションを持ち、アプリ内の地図で機体が移動するのを示すこのデータを受け取ります。マルチラテレーションの助けを借りて、Flightradar24 はカバーする地域を拡大中であり、 ADS-B トランスポンダーを持たない機体の位置も計算可能となっています。\n\nアプリでは、米国連邦航空局 (FAA) からの直接的な情報供与により、従来のレーダーデータも利用されています。このデータは、米国とカナダの全空域をほぼリアルタイムでカバーします。\n\n***重要な通知***\nFlightradar24 アプリは英語で表記されています。が、テキストはほとんどなく、追加テキストが必要な際にも可能な限り周知の記号を使っています。\n\n特別の地域の飛行機の往来追跡にのみご興味がある場合には、アプリをご購入前に Flightradar24.com にてご確認ください。Flightradar24 は、他に類を見ないレベルの世界中の機体位置データを提供していますが、カバーされていない地域もあります。 \n\nカバレッジは随時変更される場合があります。\n\nFLIGHTRADAR24 にコネクトしよう\nFlightradar24 を Facebook でイイネ！して、Twitter でフォローしよう。\n\nヘルプ & サポート\nforum.flightradar24.com/threads/89-Important-Read-this-before-you-ask-questions\nflightradar24.com/contact-us.\n\n免責\nこのアプリの使用は、厳密に娯楽目的に限られています。特に、あなた自身や他の人々の命にかかわるような活動は、使用目的から除外します。いかなる状況においても、このアプリの開発者は、データの使用や解釈により、または本同意に反する使用から起こる事柄に対し、責任を負いません。弊社は、アプリ内のユーザーの活動を匿名で追跡・報告する権利を有します。', '2010-07-31 13:29:46', '2014-06-04 15:01:59')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:02:01 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('702941320', 'JP', 'com.yy.LigaWcup', 'FIFAワールドカップ-- ブラジル W杯2014', 'http://a1494.phobos.apple.com/us/r30/Purple4/v4/2e/49/9d/2e499da7-d742-5835-f631-4ce3c764d81d/mzl.ebkunxsz.53x53-50.png', 'http://a10.phobos.apple.com/us/r30/Purple4/v4/2e/49/9d/2e499da7-d742-5835-f631-4ce3c764d81d/mzl.ebkunxsz.75x75-65.png', 'http://a535.phobos.apple.com/us/r30/Purple4/v4/2e/49/9d/2e499da7-d742-5835-f631-4ce3c764d81d/mzl.ebkunxsz.100x100-75.png', '200.00000', 'JPY', 'Yao jingxian', 'iOS_Apps', '6004', 'toppaidapplications', 0, 'ブラジルワールドカップ特集 - スポーツナビ \n\n  ブラジルワールドカップの速報､ニュース､日程、見所、結果、順位、ゴールランキング、選手名鑑情報を紹介します。\n\n  FIFAに加盟している208の国・地域（2011年時点）のうち、参加辞退のブータン・グアム・モーリタニア、国際サッカー連盟（FIFA）から資格停止処分を受けていた ブルネイを除く204の国・地域（開催国ブラジルを含む）がエントリーし（前回大会と同数）、後に棄権したモーリシャスを除いた参加国数の203は過去最多で、初めて200を上回った。 なお、シリアはアジア2次予選を勝ち抜いていたが、その後のアジア3次予選開始前に、出場資格のない選手を出場させていたとして失格になった。\n本大会出場チームは32チーム。開催国のブラジルは予選を免除される。2006年大会および2010年大会と同様、前回優勝国の予選免除は行われない。よって31チームが予選により選出される。\n\n\n予選をよりよい時期に行えるようにするため、以前に比べ6ヶ月ほど早く抽選を行うものとされた。2011年7月30日にブラジル・リオデジャネイロで抽選が行われた。\n\n大陸連盟別の出場枠は以下の通り。前回（2010年）大会の予選との違いは、開催国枠がアフリカから南米に移ったのみである。UEFA・CAFは連盟内で予選が完結する一方、他の4連盟から進出した各1チームは大陸間プレーオフにより出場枠を競う。大陸間プレーオフの組み合わせは抽選によって決められる。\n\n\n■提供するサッカーワールドカップ（W杯）ブラジル大会専用アプリです。\n\n■掲載されるサッカーニュースや、専門ライター陣によるコラムが無料で読めます。\n\n■グループリーグの組み合わせや試合日程、出場国、競技場など大会に関する情報が簡単に調べられます。\n\n■グループリーグの順位を予想し、自分だけの決勝トーナメント表を作れます。トーナメント表はSNSでシェアしたり、ユーザーの予想を集計して「みんなの決勝トーナメント予想」を作る機能もあります。\n\n■W杯やサッカーに関するクイズやアンケートを楽しめます。\n\n■国際サッカー連盟（FIFA）のオフィシャルメディアサポーターです。アプリで配信する記事はFIFAとは関係なく、独自の取材によるものです。', '2013-09-18 04:24:33', '2014-06-04 15:02:01')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
