k Inc.\nMyTopFans for Facebook is not affiliated with, endorsed, or sponsored by Facebook.', '2012-09-20 16:00:00', '2014-06-04 15:02:03')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:02:04 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('576588894', 'JP', 'com.fifthstarlabs.skyguide', 'スカイ・ガイド – 星図', 'http://a513.phobos.apple.com/us/r30/Purple/v4/f9/c7/44/f9c744ab-3156-87a6-880d-56ac6ce25377/mzl.gehkirnd.53x53-50.png', 'http://a1381.phobos.apple.com/us/r30/Purple/v4/f9/c7/44/f9c744ab-3156-87a6-880d-56ac6ce25377/mzl.gehkirnd.75x75-65.png', 'http://a786.phobos.apple.com/us/r30/Purple/v4/f9/c7/44/f9c744ab-3156-87a6-880d-56ac6ce25377/mzl.gehkirnd.100x100-75.png', '200.00000', 'JPY', 'Fifth Star Labs LLC', 'iOS_Apps', '6006', 'toppaidapplications', 0, '星と星座のガイドが今までになく美しく、使いやすくなりました。空にかざすだけで自動的に恒星、星座、惑星、衛星などを見つけることができます。年齢や経験を問わず、すべての人が星を楽しく眺められるのがスカイ・ガイドです。\n \n「休みなく回り続ける恒星、惑星、衛星についてもっと詳しく知りたい人には、スカイ・ガイドが最高のアプリだ。」\n-CNET\n \nあれは恒星、それとも土星？ スカイ・ガイドの登場で、夜空のことを簡単に調べられるようになりました。iPhoneやiPadを空にかざすと、 スカイ・ガイドはあなたがどの星を見ているか自動的にわかってくれます。面倒なセットアップは全く必要ありません。\n \nおとめ座、アンドロメダ銀河、火星など、何を探すにしても、スカイ・ガイドがあなたの好奇心を満たします。幾千もの天体を検索することができて、ただ矢印を追うだけで実際の上空に見えるその星や星座などの正確な方向に案内してくれます。\n \n上空を通過する衛星を見てみたいと思ったことはありませんか？スカイ・ガイドでは、数百もの可視衛星を追跡できます。衛星の上昇や宇宙空間を通過する経路図を確認できます。衛星識別機能や、詳細な履歴情報、今後の上空通過時刻を提供するアドオンパックも別途ご利用できます。\n \n時間の早送り、巻き戻し機能を使って過去や未来の星空も探検できます。夜になったら月がどの位置にくるのかが前もって確認できるので、狙い通りの素敵な夜空の写真を撮ること等もできます。また、大型の彗星（すいせい）の接近を観察し、太陽を回り込むにつれ彗星の尾が発達していく様子を確認することもできます。\n \n従来の天文アプリとは違い、スカイ・ガイドは夢中になれるビジュアル重視の体験を提供します。アプリ開発者の一人が自ら撮影した極めて解像度の高い写真を使用しているため、模造した数千の点を集めた夜空の画像でない、何百万もの実写の星々を眺めることができます。またさらに、使用する場所の環境に合わせて、HDR輝度調節で星の光度を調整することもできます。\n \nスカイ・ガイドは少ないボタンで直感的な操作ながらも、コンテンツは盛りだくさんです。著名な天文書著者による豊富な説明や関連記事を多く含み、気軽な趣味・興味レベルで使いたい人からベテランの天文愛好家までがエンジョイできるものになっています。\n \nスカイ・ガイドはWi-Fi、データ、GPS信号の有無を問わず機能します。キャンプ先や海外でも使用できます。何時でも、どこでも、使い方も楽しみ方も自由且つ千差万別です。\n \nさらに、Mat Jarvisのデザインによるオリジナルサウンドや、暗闇に順応した目に優しいレッドナイトモードがあります。\n\n• リッチ コンテンツ: 多数の見事なグラフィック、オリジナルのアートワーク、および詳細な記事。\n• フィルター： X 線の空を観測して、目に見えない驚異を探索。\n \nご注意：スカイ・ガイドは、ジャイロスコープを必要とするため、iPad 1やiPhone 3GS以前の機種では機能しません。iPod Touchでは、使用前に手動で向きをキャリブレーションする必要があります。', '2013-05-07 04:45:52', '2014-06-04 15:02:03')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:02:05 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('388624839', 'JP', 'com.intsig.CamScanner', 'CamScanner+', 'http://a977.phobos.apple.com/us/r30/Purple/v4/d4/e6/94/d4e69443-e6cf-162c-2e25-d0589ee96b2b/mzl.cdxglqig.53x53-50.png', 'http://a1493.phobos.apple.com/us/r30/Purple/v4/d4/e6/94/d4e69443-e6cf-162c-2e25-d0589ee96b2b/mzl.cdxglqig.75x75-65.png', 'http://a786.phobos.apple.com/us/r30/Purple/v4/d4/e6/94/d4e69443-e6cf-162c-2e25-d0589ee96b2b/mzl.cdxglqig.100x100-75.png', '100.00000', 'JPY', 'IntSig Information Co.,Ltd', 'iOS_Apps', '6007', 'toppaidapplications', 0, '*  毎日50000人を超えるユーザーが新規登録\n* 6000万人以上のユーザー、200以上の国・地域で使用されるスキャンアプリ！\n* App Store 2011、2012年度ナンバーワンビジネス/仕事効率化アプリケーション\n* ｢CamScannerは特別な画像処理技術でドキュメントがより読みやすくなる｣—Makeuseof.com\n* ｢間違いなくCamScannerは携帯電話で一番のスキャナーアプリ｣—CNET.com\n*「簡単なドキュメント管理アプリでドキュメントをより読みやすくデータ化」—Mynavi.jp\n* iPhoneトップ50アプリの一つ―アメリカ「タイム」\n\nCamScannerはドキュメントスキャン、ストレージ、管理、共有、交流、共同、同期機能をサポートしており、手持ちの携帯電話がスキャナー、ファクシミリ、PDFコンバーター、テキスト変換ツールとドキュメント共有プラットフォームに変身！\n\n\n----世界でも優秀な最先端の特別なコア技術！ ---\n* 自動でドキュメントを高速スキャン、鮮明な画像やPDFに変換\n* OCRでドキュメントを認識、画像上の文字をテキストに変換\n* ドキュメントを共有、友達を招待してドキュメントを共有、評価\n\n\n\n----機能説明----\n【スマホがスキャナーに】\nスマホのカメラで撮影したドキュメント画像を、瞬時に鮮明スキャン。優秀な世界最先端の画像処理技術なので、撮影した効果は普通のスキャナーよりも高画質。アプリをインストールするだけで、スマホがポケットサイズのスキャナーに。\n\n【手軽に記録できる電子データベース】\n本、漫画、リーフレット、領収書、図面やホワイトボードなどの非デジタルファイル\nを保存したい場合は、このアプリで簡単解決。撮影するだけで、自動で余分な背景を削除、ドキュメントの品質を強化した上で、読みやすく変換して保存できます。\n\n【画像をテキスト化】\nOCR機能を使い画像上の文字を認識してテキストドキュメントに変換。認識結果を編集し、保存或いは共有もできます。様々な文書をスキャンしてOCR処理後、編集可能な電子ドキュメントに変換。紙の書類が一瞬で電子データになります。\n\n【PDFコンバーター】\nスキャンして保存した本、資料、PPT、リーフレット、図面をPDF形式で共有。十数種のPDF標準サイズを選択可。電子版ファイルやPDF形式のドキュメントが必要な場合は、このアプリで解決。\n\n【AirPrint・ファクシミリ】\n携帯電話で重要なファイルを撮影して保存するだけで、いつでもAirPrintで印刷や30以上の国・地域にファクスの送信が可能。旅行や出張中でのファイル送信などの緊急事態に簡単に対応。\n\n【ドキュメント共有のプラットフォーム】\n任意のドキュメントをスキャンした後は、友達や同僚を招待して一緒にドキュメントを確認・評価できます。さらにドキュメントをメールやリンクなどで共有やSNSアカウントに転記も。\n\n【ドキュメント管理ツール】\nドキュメント画像を閲覧する時に手書きでマークやメモがかけます。大量のドキュメントがある場合、検索機能で目的のドキュメントを素早く検索。タグ管理でドキュメントの分類も可。パスワード設定で情報セキュリティーも問題なし。\n\n【ドキュメント同期サービス】\n重要なドキュメントの紛失防止のために、アカウント登録後、ドキュメントをCamScannerのクラウドに保存できます。一台以上の携帯電話、タブレットを持っている場合は同時に、同期もでき、ドキュメントを複数のデバイス間で瞬間にコピー・送信します。\n\n----高級アカウント----\n*高級アカウントユーザーは10Gものクラウドストレージをプレゼント\n*ドキュメント共有の人数を40人追加\n*ドキュメント画像上の文字をテキストに変換\n*暗号化リンクでドキュメントを共有\n\n\nCamScanner高級アカウントは自動リニューアルサービスを提供します。二つの方式から選択できます。：\n\n* 月間版：RMB  30／月\n\n* 年間版：RMB  300／年 \n\niTunesアカウントのクレジットカードでCamScanner高級アカウントを購入できます。購入の期日（一月/一年）が終了するまでにリニューアルをキャンセルしない場合、自動で次の周期にリニューアルされます。期限内の場合、現在の期限をキャンセルすることはできません。\n\n----使用場面----\n\n* ビジネスマン：出張中で外から契約書、ファイル、領収書、クーポン、航空券をスキャン。スキャンしたドキュメントをメールで送信・ファックス。\n* 学生教師：ノート、ホワイトボード、カリキュラム、本、PPTをスキャン。キーワードを入力するだけでドキュメントを検索。\n* デザイナー、マンガ家やまた芸術家でなくても絵を描くことが好きな人：デザイン原稿、漫画の試作品、アイデアやインスピレーションを撮影して保存。\n* 旅行者：パスポート、運転免許証、IDカード、旅行計画、荷物リスト、地図、旅行テクニックをスキャン。インターネットがなくても持ち歩き！\n* 両親：説明書、光熱費の明細、預金通帳、銀行カード、会員カード、料理本をスキャンし、タグ付けで分類して保存、考えを整理。子供の宿題、落書き、満点答案もスキャンして記念を一生保存……\n\n\nCamScannerを気に入っていただけましたら、或いはご意見がございましたら、少しお時間をいただき、CamScannerのご評価或いはisupport@intsig.comまでご連絡をお願いします。商品の改善へのご協力により更に多くの優れた機能を体験していただけますよう努力して参ります。\n\n\n----ご利用アドバイス----\n弊社製品をご使用の際に、よりよい効果を得るため：\n* 画像がはっきりしていればそれだけ認識精度も高まります。「明るい場所で、極力手ぶれの少ない状態で撮影してください」\n* 画像が大きければそれだけ認識精度も高まります。「撮影する際には画像が大きくディスプレイに表示されるようにしてください。」\n\n\n新浪微博で私達をフォロー@扫描全能王\nTwitterで私達をフォロー@camscanner\nFacebookで私達をフォロー：camscanner\nGoogle+で私達をフォロー：camscanner\n\n\n----弊社の他のアプリケーション----\n\n----名刺認識管理CamCard\n* 全世界5000万人以上のエリートビジネスマンが使用する名刺管理アプリ！\n* App Store 2011、2012年度ナンバーワンビジネスアプリケーション\n* 「CamCardは文句なしに名刺認識アプリのナンバーワン！」――ニューヨーク•タイムズ紙\n* 「一瞬で営業情報を保存、営業担当必須のアプリ」——Inc.\n* 「大量の名刺を一気に携帯電話に入力、とても簡単！」——CBS\n* 「CamCardはスマートフォン時代に我々が如何に連絡先情報の保存と共有をすべきかを教えてくれるベストモデル。」——BBC\n----CamDictionary\n* App Store 2011、2012年度ナンバーワンビジネスアプリケーション', '2010-08-28 04:01:23', '2014-06-04 15:02:04')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
