r Splash, Black & White \n強度調節機能 \n200種のすべての写真の効果を選択した部分のみを追加することができるマスキングツールを提供 \n様々な写真の効果の組み合わせであなたの個性を表現 \n\n• カラースプラッシュ \n直感的で迅速に反応する描画インタフェース \nUndo機能/反転機能/ブラシサイズと柔らかさ、強弱の調節機能を提供 \n白黒写真で部分的に選択的なカラーを適用することができるカラースプラッシュ機能 \n\n• ライブチルトシフト \n3つのタイプのブラー エフェクト : 線形、円形、楕円形 \nリアルタイムでぼかし効果を見ることができます。 \n\n• 部分明度補正（Dodge & Burn）\n必要な部分だけ自由に明るさのを調節可能なするリタッチの機能\n\n• 各時代の雰囲気を写真に！タイムマトリックス \nあなたの写真を年度別に、その時代に合った雰囲気を出す、タイムマシーンのような効果を提供します。他のアプリでは経験したことのない素晴らしい機能、タイムマトリックスを是非体験してみてください。 \n\n• 一般ユーザーから専門家まで、様々な目的の使用者のための編集ツール \n色相、対比、彩度、自然な彩度、露出, ホワイトバランスなどの基本エディット機能 \n繊細な表現と編集ができるヒストーグラム, 色相カーブ、モノトーンカーブ、鮮鋭化など、専門的な編集機能 \n\n• 写真装飾する \nテキスト - 200以上のフォント、80種の色とパターン、カラーパレット、14種のフォントスタイル、24種のラベル \n描画 -ブラシサイズの変更、32種の色と48種のカラーパターンブラシ、カラーパレット、30種のボケと20種のロールスタンプ、クリア機能 \nスタンプ - 数百種類の感情表現ができるスタンプ機能, 写真切り抜き機能（フォトスタンプ）\nテクスチャ - ビンテージとボケテクスチャ、光漏れ、ブレンドモード(通常、明るく、暗く)、 シャッフル機能(Shuffle)、ライブマスキング \nライブヴィネット - 24種のカラーヴィネット、強弱調節 \nフレーム - 数十種の実用的なフレームデザイン, 円形と厚さ調整機能 \n\n• Line, Instagram、Facebook、Twitter, Flickrに写真を送る \n\n皆さんの貴重なご意見をお待ちしております。ありがとうございます！ \n\nFacebook : http://www.facebook.com/PicsPlay \nEmail: contact@jellybus.com \nHomepage : http://www.jellybus.com', '2012-11-16 09:25:18', '2014-06-04 15:02:05')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
