Error - 2014-06-04 15:02:09 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('447024088', 'JP', 'jp.co.navitime.NAVITIMEBicycle', '自転車NAVITIME　', 'http://a739.phobos.apple.com/us/r30/Purple/v4/d9/6c/52/d96c522a-2f13-3ff2-c3db-e52b64a4c8c0/mzl.qyvsfcyg.53x53-50.png', 'http://a1255.phobos.apple.com/us/r30/Purple/v4/d9/6c/52/d96c522a-2f13-3ff2-c3db-e52b64a4c8c0/mzl.qyvsfcyg.75x75-65.png', 'http://a1060.phobos.apple.com/us/r30/Purple/v4/d9/6c/52/d96c522a-2f13-3ff2-c3db-e52b64a4c8c0/mzl.qyvsfcyg.100x100-75.png', '400.00000', 'JPY', 'NAVITIME JAPAN CO.,LTD.', 'iOS_Apps', '6010', 'toppaidapplications', 0, 'サイクリングをより快適に強力サポート！\n音声案内やルートの高低差グラフなど、自転車に特化したナビゲーションアプリです。\n  ・走行時間や距離から目的地を検索できます！\n  ・地点と走行ログの共有がメッセージ(SMS)やFacebookでもできます！\n  ・昼と夜で地図の配色が自動で切替わります！\n\n【主な機能】\n■音声ナビ\n目的地までの音声ナビゲーションを行います。\n\n■高低差グラフ\n高低差グラフを表示し、ルートの起伏を一目で確認することができます。また走行中は自分が高低差グラフ中のどのあたりにいるか確認できるため、適切なギアチェンジやペース配分などを考える際にも便利です。\n\n■省電力機能\n節電モード：音声ナビ中に節電ボタンをタップすると、画面を暗くした状態で音声案内を継続します。\nポケットモード：ポケットモードを有効にしておけば、端末をポケットにしまうと画面がOFFになり、より消費電力を抑えることができます。\n\n■ルート検索\n以下の7種類のルートを検索できます。\n  ・推奨ルート(※1)\n  ・距離が短い\n  ・坂道が少ない\n  ・坂道が多い\n  ・大通り優先\n  ・裏通り優先\n  ・サイクリングロード優先(※2)\n※1「推奨」とは、距離・時間・高低差などを考慮した自転車で走りやすいルートです。\n※2「サイクリングロード優先」はプレミアムコースの機能になります。詳しくは下記「プレミアムコースで使える機能」をご覧下さい。\n\n■スポット検索\n650万件のスポット情報を搭載！フリーワードで検索したり、現在地からの距離や時間を指定して、その付近にあるスポットを検索できます。たとえば「1時間で行けるラーメン屋」などの条件指定で目的地を検索することも可能です。\n\n■自宅登録\n自宅の位置が登録できます。登録しておくと自宅へ帰るルートや自宅からのルートを簡単に検索できます。\n\n■地点共有\n地点をメール/メッセージ(SMS)/Twitter/Facebookで共有したり、連絡先に登録できます。\n\n■電子コンパス\n現在地の矢印が端末の向きに合わせて回転する固定モード、地図が端末の向きに合わせて回転する回転モードの2種類のモードが利用可能です。\n\n■サイクリングロード特集\n全国の人気サイクリングロードをピックアップし、コース全体図や立ち寄りスポットを写真付きで紹介しています。（※掲載コースは「掲載サイクリングロード」の項目をご確認ください）\n\n【プレミアムコースで使える機能】\n■サイクリングロード優先ルート\nルート検索で、サイクリングロードが近くにある場合、優先的に通るルートを検索できます。全国のサイクリングロード120ヶ所に対応しています。\n\n■走行ログ\n走行したルートや距離、消費カロリーなどを記録・閲覧できる機能です。 ログは、月次リストと日次リストで見ることができます。実際に自転車で走ったルートが地図上に表示されます。また、お気に入りのルートをメール/メッセージ(SMS)/Twitter/Facebookで共有したり、KML形式で出力もできます。\n\n■My地点\nお気に入りの地点を最大100件まで保存することができます。保存した地点は他のNAVITIMEサービスでも使えます。\n\n【プレミアムコース】\n利用期間に応じて以下の3コースから選べます。(全て税込)\n  ・30日 (200円)\n  ・180日 (1,200円)\n  ・365日 (2,200円)\n\n【対応ハードウェア】\niPhone4、iPhone4S、iPhone5/5S/5C、iPad3Gモデル\n※iPod touch、iPad Wi-FiモデルなどGPS非搭載端末はサポート対象外です。\n【対応OS】\niOS6.0以上 \n\n【掲載サイクリングロード】\nちば里山若葉コース、ちばベイサイド美浜コース、Cycle Aid Japan 2013（全12コース）、瀬戸内しまなみ海道、安芸灘とびしま海道、荒川サイクリングロード、江戸川サイクリングロード、多摩川サイクリングロード\n\n【ご注意】\n・ルート検索で使用する道路情報は、自動車用のものを基にしています。自転車では通行しづらいルートを案内する場合がありますが、必ず交通規制に従って走行してください。自転車用の道路情報の整備は随時進めており、ルートについても改善予定です。\n・自転車NAVITIME以外の｢NAVITIME ID｣ではログインできません。\n・バックグラウンドでGPSを使用し続けると、バッテリーを多大に消費する可能性があります。', '2011-07-13 16:00:00', '2014-06-04 15:02:08')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:02:10 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('476661454', 'JP', 'com.bitcount.StagePass', 'StagePass', 'http://a1648.phobos.apple.com/us/r30/Purple/v4/e8/a0/36/e8a03638-4827-b7a0-688d-337f78be84e7/mzm.kxndfvlg.53x53-50.png', 'http://a516.phobos.apple.com/us/r30/Purple/v4/e8/a0/36/e8a03638-4827-b7a0-688d-337f78be84e7/mzm.kxndfvlg.75x75-65.png', 'http://a1345.phobos.apple.com/us/r30/Purple/v4/e8/a0/36/e8a03638-4827-b7a0-688d-337f78be84e7/mzm.kxndfvlg.100x100-75.png', '100.00000', 'JPY', 'Bitcount ltd.', 'iOS_Apps', '6011', 'toppaidapplications', 0, '日本の皆様、愛をありがとう!! 音楽アプリチャート1位、全体で6位になりました!!!\n\n「人生を変えるアプリ。新しい音世界の始まりだ。」- Westword\n\n「StagePassは、驚くべき音楽体験への確かな道である。」 - AppModo\n\nStagePassは、音楽を驚きの経験にする新しい方法です。世界有数の会場で、オーディエンスの一人となって、貴方だけの音を聴いてみましょう。\nこれは、会場の豊かな音の空間の微妙なニュアンスを再現するアプリです。\n\n約2年間の開発期間中、各会場に足を運び、生の音を聞く事で、僕達は遂にこのStagePassを作り上げ、特製のバイノーラル・マイクを使用することで、会場の生の音を、今までにない形、音質、イメージで、クリアに再現可能にしました。\nさあ、ヘッドフォンを着けて、会場の広さ、形、そして目の前にあるステージを感じて下さい。\n\n自分だけの体験を作り上げましょう。地元の大好きなバンドの演奏を、大きなシアターやコンサートホールで聞いてみてください。\n有名アーティストのデビュー当時を思い出して、彼らのライブハウスでの演奏をもう一度聞いてみてください。\n音の可能性は無限大に在ります。\n\n今も僕達は、会場内の音のスィートスポットを探す為に、各会場に足を運んでいます。貴方に会場の一番良い席で音楽を聴いてもらう為に。\nそして、これからも多くの素晴らしいコンサート会場の音を再現し、随時追加していきます。\n\n次の会場は?\n\nフォローお願いします!!:\nFacebook - facebook.com/stagepassmusic\nTwitter - @bitcountltd\n\nCompatibility note:\n\niOS 4.3.4以前のOSを使用の場合、StagePassでアーティスト表示がされない場合があります。解決するにはOSを4.3.5以降の物にしてください。', '2011-11-04 16:00:00', '2014-06-04 15:02:10')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:02:15 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('682293714', 'JP', 'jp.co.waterbear.SleepIfUCan', '絶対に目が覚める！おこしてME', 'http://a349.phobos.apple.com/us/r30/Purple/v4/27/2a/60/272a6065-d65f-daed-7aad-6772317007e3/mzl.bzyfvimu.53x53-50.png', 'http://a865.phobos.apple.com/us/r30/Purple/v4/27/2a/60/272a6065-d65f-daed-7aad-6772317007e3/mzl.bzyfvimu.75x75-65.png', 'http://a1918.phobos.apple.com/us/r30/Purple/v4/27/2a/60/272a6065-d65f-daed-7aad-6772317007e3/mzl.bzyfvimu.100x100-75.png', '100.00000', 'JPY', 'Waterbear Soft inc.', 'iOS_Apps', '6012', 'toppaidapplications', 0, '写真照合でアラームを止める目覚ましアプリ。これは絶対目が覚める！\n\n「絶対に目が覚める! おこしてME」は自分で設定した写真と、同じ写真を撮影してアラームを止める目覚ましアプリです。\n\n写真照合をクリアしないと、永遠にアラームが止まりません！美女やイケメンでも起きられない方、このアプリで起きましょう！\n\n■アラームの止め方\n　○基本　-　普通にアラームストップボタンを押すだけで止まります。\n　○写真を撮る　-　設定した画像と同じ写真を撮影します。少しでも違うとアラームが止まりません。\n　○シェイクする　-　携帯を設定した回数分シェイクしないとアラームが止まりません。\n\n■曜日設定\n　曜日選択が可能です。特定の曜日にだけアラームを使いたい時に便利です。\n\n■アラーム音設定\n　アラーム音は、ミュージックライブラリーの曲から指定することも可能です。お気に入りの音楽で起きたい方にもオススメ。\n\nアイディアしだいで2度寝防止に！\n\nどんな写真でもアラーム停止用に使えますが、写真を再現できないとアラームが止まないので要注意です。\n\n洗面所の写真を使えば、アラームを止めたタイミングで顔を洗えます。いつも二度寝してしまう方はぜひダウンロードしてみてください。\n\n------------------------------------\n開発：Waterbear Soft Japan Inc\n------------------------------------\n\nご意見ご感想はこちらまでお寄せ下さい。\nwaterbear.help@gmail.com\n\nMobile Page : http://waterbear.jp/m/ \nFacebook: http://www.facebook.com/waterbearsoft.jp\nTwitter: https://twitter.com/waterbearsoftjp\nAmeba: http://ameblo.jp/waterbearsoft/', '2013-08-14 07:28:24', '2014-06-04 15:02:15')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:02:18 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('680170305', 'JP', 'net.7minworkoutapp', '7 分間エクササイズ - 7 Minute Workout Challenge', 'http://a1237.phobos.apple.com/us/r30/Purple4/v4/d9/79/e9/d979e9d7-25ef-206f-cd4d-1f2a55d76fc8/mzl.oyljxfjm.53x53-50.png', 'http://a1753.phobos.apple.com/us/r30/Purple4/v4/d9/79/e9/d979e9d7-25ef-206f-cd4d-1f2a55d76fc8/mzl.oyljxfjm.75x75-65.png', 'http://a1958.phobos.apple.com/us/r30/Purple4/v4/d9/79/e9/d979e9d7-25ef-206f-cd4d-1f2a55d76fc8/mzl.oyljxfjm.100x100-75.png', '200.00000', 'JPY', 'Fitness Guide Inc', 'iOS_Apps', '6013', 'toppaidapplications', 0, '「7 分間ワークアウト」はリサーチに基づいたワークアウトプログラムです。世界的なヒットを記録しています! \n\n論文誌 ACSM にも掲載され、ニューヨークタイムズによって人気を獲得した「7分間ワークアウト」はシンプルですが、効果的です。 \n\n30 秒間行うワークアウトを 10 秒間隔で行う 12 のエクササイズを研究者が厳選。休みを少なく入れた高集中トレーニングで、1 日のメタボリズムを高めることができ、7 分強の運動で、1 時間以上の運動量に匹敵する効果が得られます。 \n\n最も注目していただきたいのは、このエクササイズがとてもシンプルだという点です。特殊な機器は必要ありません。どこにいてもエクササイズできるのです! これで言い訳はできませんね。 \n\nこのアプリでは、研究によって裏付けられたワークアウトを行っていきます。効果を追跡し、ワークアウトを続けるうちにご褒美ももらえるようになっており、楽しく続けることができます。 \n\nアプリの機能: \n\n- おしゃれなデザイン \n- 男性と女性のトレーナーが、ビデオ、オーディオ、画像、テキストでエクササイズをご案内します \n- すべてのコンテンツが料金に含まれています (追加料金はかかりません。インターネット接続も必要ありません) \n- ウェイトトラッカーで体重を管理できます \n- アクティビティカレンダーでアクティビティを追跡できます \n- ワークアウトしながら、さまざまなアチーブメントをアンロックできます \n\n弊社はフィットネスのプロを集めアプリ開発を行っています。最高品質の製品をお届けすることに細心の注意を払っています。ご意見やご提案などは、お気軽にお寄せください。アプリは定期的に追加料金なしでアップデートしていただけます。', '2013-07-31 06:50:20', '2014-06-04 15:02:17')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:02:20 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('793660476', 'JP', 'jp.co.spike-chunsoft.terrariajp', 'テラリア', 'http://a1941.phobos.apple.com/us/r30/Purple/v4/68/18/64/681864a9-65a7-2116-5e68-39eb4025ea59/mzl.ifscidpt.53x53-50.png', 'http://a457.phobos.apple.com/us/r30/Purple/v4/68/18/64/681864a9-65a7-2116-5e68-39eb4025ea59/mzl.ifscidpt.75x75-65.png', 'http://a1574.phobos.apple.com/us/r30/Purple/v4/68/18/64/681864a9-65a7-2116-5e68-39eb4025ea59/mzl.ifscidpt.100x100-75.png', '500.00000', 'JPY', 'Spike-Chunsoft CO, LTD.', 'iOS_Apps', '6014', 'toppaidapplications', 0, '！！！一部のポケットWiFiに端末を接続している場合、アプリが起動しないことがあるという現象が確認されています。アプリが起動しない場合、一度［機内モード］をオンにするなどして、ネットワークから切断して起動できるかどうかご確認ください。！！！ \n\n掘る、作る、戦う。遊びかたは無限大！\n\n2D横スクロール型モノづくりアクションアドベンチャー「テラリア」が、日本語に対応してiOSに登場！\n\nテラリアの世界は木や土、鉱石などのブロックで構成されており、ツルハシやオノなどを使って切り崩すことで、素材として収集できる。\n集めたブロックやモンスターが落とす素材などを使えば、アイテムを作ったり、自由な形の建造物を建てることが可能。\n新たな素材を求めて、そしてまだ見ぬ敵を求めて広大なマップを自由に散策しよう。\n\n・文字入力\n本アプリ内でのキャラクター名とワールド名の入力は、英数字にのみ対応しています。ご利用端末のキーボードをローマ字入力に切り替えて入力してください。\n\n・マルチプレイ\n本アプリは、最大4人のアドホックマルチプレイに対応しています。同じWi-Fiに接続した他のプレイヤーのワールドが、「ゲームに参加」画面に表示されます。\n\n 「テラリア」の世界をもっと知りたい方は、公式ウェブサイトをご確認ください。\n  http://www.spike-chunsoft.co.jp/terraria/app\n\nテラリアiOS版ユーザーサポート\n  support-terraria-ios@spike-chunsoft.co.jp\n※ゲームの攻略法に関するお問い合わせにはお答えいたしかねます。\n\n-------\n\nPublished by 505 Games (and Spike Chunsoft for Japan region). © 2014 Re-Logic. Mobile versions developed by Codeglue. All Rights Reserved.\n本ソフトウェアでは、フォントワークス株式会社のフォントを使用しています。フォントワークスの社名、フォントワークス、Fontworks、フォントの名称は、フォントワークス株式会社の商標または登録商標です。', '2014-05-27 16:00:00', '2014-06-04 15:02:20')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:02:22 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('339986225', 'JP', 'com.gmail.shibuym.ExpenseBook', '支出管理', 'http://a852.phobos.apple.com/us/r30/Purple/v4/ca/bd/74/cabd7460-59cc-43a8-b73a-4678bb249482/mzl.sspnotjv.53x53-50.png', 'http://a1368.phobos.apple.com/us/r30/Purple/v4/ca/bd/74/cabd7460-59cc-43a8-b73a-4678bb249482/mzl.sspnotjv.75x75-65.png', 'http://a341.phobos.apple.com/us/r30/Purple/v4/ca/bd/74/cabd7460-59cc-43a8-b73a-4678bb249482/mzl.sspnotjv.100x100-75.png', '100.00000', 'JPY', 'SHIBUYA Masanori', 'iOS_Apps', '6015', 'toppaidapplications', 0, '「支出管理」は、予算を立てて毎月の支出を管理するアプリケーションです。\n家計やおこづかい、経費などの管理にお役立てください。\n\n◆iOS 7でお使いいただけます\n◆ランキング獲得　AppStoreオールタイムトップ25 10位、2010年年間有料総合4位、 2011年年間有料総合27位、iPhone有料総合1位、カテゴリ1位\n\n\n[支出管理の使い方]\n\n1. 予算をたてる\n計画的に貯金をするためには、あらかじめ貯金を天引きしてしまうのが確実です。毎月の大体の収入から、貯金したい金額と固定支出(家賃やローン、保険など)を引いてみましょう。それが一ヶ月に自由に使える予算です。\n\n2. 支出をコントロールする\n一ヶ月間心がけることは2つだけです。\n\n*お金を使ったらすぐに「支出管理」に記録する\nお金を使ったら忘れないうちにiPhone/iPod touchに記録しましょう。「支出管理」には、すばやく記録する工夫がたくさんあります。例えば、レシートや品物の写真を撮影できます。よくある支出をテンプレートにしておけば2タップで記録できます。\n\n*予算線を超えないよう気をつける\n”日別の推移”グラフで、毎日の支出が積み上がる様子が確認できます。斜めの予算線は、その日までに使って良いお金です。この線を超えてしまいそうになったら、少し我慢して考え直してみてください。\n\n3. 振り返る\n1ヶ月が終わったら結果を振り返ってみましょう。グラフや表で予算と結果を比較すると、予算と合わないことがあるかもしれません。次の月はもっと正確に予算をたてることが出来るでしょう。無駄に気づき、予算を削れる部分が見つかるかもしれません。\nこれで1ヶ月が終わり、次の月、また1から繰り返します。\n\n「支出管理」には、分析のためのタグ等この他にも便利な機能がたくさんあります。\n\n「支出管理」に蓄積した大切なデータや写真は、いつでも簡単にGoogleドキュメントに送って安全に保管することができます。たとえあなたのiPhoneが壊れても、買い替えても、データを引き継ぐことができます。安心して末永くお使いください。\n\n[主な機能]\n\n予算\n月の開始日設定\n分類と予算のカスタマイズ\n標準と異なる月は個別に月別予算を設定可能\n\n記録\nスライダーによる金額入力\n電卓による金額入力(金額をタップ)\nカレンダーで日付入力\n写真の添付\nテンプレート\n\nグラフ\n4種類のグラフ\nグラフにタッチすると明細が見られます\n\n表\n4種類の表\n\n検索\n6つの条件(期間,金額,分類,名前,タグ,メモ)の組み合わせで支出項目を抽出できます。\n\nタグ\n支出にタグ付けし、表やグラフで集計できます。\n\n外部連携\nGoogleドキュメント連携\n\n※おしらせ\n・初期設定ではアプリ終了後1分間はパスコードロックされません。すぐにロックするには”アプリ切替時のロック”の設定を変更してください。\n・ご質問や不具合のご報告はサポートサイトをご利用ください。', '2009-11-20 05:25:02', '2014-06-04 15:02:21')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
