Error - 2014-06-04 15:02:38 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('364543737', 'JP', 'com.intsig.camcard.ja2', 'CamCard - 名刺認識管理', 'http://a178.phobos.apple.com/us/r30/Purple4/v4/51/17/bd/5117bd3b-c2bf-0b4f-7e5a-a98edbce01f4/mzl.hvzgddze.53x53-50.png', 'http://a1046.phobos.apple.com/us/r30/Purple4/v4/51/17/bd/5117bd3b-c2bf-0b4f-7e5a-a98edbce01f4/mzl.hvzgddze.75x75-65.png', 'http://a595.phobos.apple.com/us/r30/Purple4/v4/51/17/bd/5117bd3b-c2bf-0b4f-7e5a-a98edbce01f4/mzl.hvzgddze.100x100-75.png', '100.00000', 'JPY', 'IntSig Information Co.,Ltd', 'iOS_Apps', '6000', 'topgrossingapplications', 0, 'バレンタインデーのタイムサービス　―　90％オフ！ \n\n*　全世界ダウンロード数最多の名刺管理アプリ！\n*　全世界5000万人以上のエリートビジネスマンが使用！\n* App Store 2011、2012年度ナンバーワンビジネスアプリケーション\n* 「CamCardはスマートフォン時代に我々が如何に連絡先情報の保存と共有をすべきかを教えてくれるベストモデル」——BBC\n* 「CamCardは文句なしに名刺認識アプリのナンバーワン！」――ニューヨーク•タイムズ紙\n* 「一瞬で営業情報を保存、営業担当必須のアプリ」——Inc.\n* 「大量の名刺を一気に携帯電話に入力、とても簡単！」——CBS\n\n\nCamCardは最もプロフェッショナルな名刺認識・管理アプリです。様々な言語の名刺を迅速かつ正確に認識し、自動でアドレス帳に保存。また、名刺に画像、ビデオを追加することで個人、製品、会社を全方位から紹介できます。さらに、オンタイムで更新可能な人脈バンクは、顧客訪問や顧客リレーションの管理に役立ちます。\n\n\n\n-------特別なコア技術、世界最先端-------\n*  携帯電話で名刺を撮影、情報は一瞬でアドレス帳に登録\n*  名刺にイメージ、画像、ビデオ、SNSアカウントを追加\n*  オンタイム更新の人脈バンクで連絡先の状態を把握\n*  顧客訪問や顧客リレーション管理に役立つ\n\n\n\nサポートシステム：\niPhone 3GS, iPhone 4, iPhone 4S, iPhone 5, iPhone 5s, iPhone 5c, iPod Touch 5, iPad(Retina), iPad mini\n\n\n-------機能説明-------\n\n【名刺認識】\n携帯電話で名刺を撮影、情報は一瞬でアドレス帳に登録\n複数名刺を撮影し、まとめて認識\n16種類の言語の名刺、QRコード名刺、メール署名名刺の認識をサポート\n\n\n【名刺交換】\nQRコードの撮影や「同時タップ」で瞬時に名刺を交換、名刺情報を気軽にシェア\n\n\n【クラウドサービス】\nアカウント登録で全ての名刺をクラウドに保存し、永久管理。携帯電話、タブレット、パソコンでいつでも名刺情報を確認。人脈管理は更に安全・便利に。\n\n\n【プロフィール】\nビジネス情報を表示する個人ホームページ。名刺、画像、音声、ビデオ、SNSアカウントを追加し、個人、製品、会社を全方位から紹介。相手に深い印象を残し、製品と会社への理解も深まります。\n\n\n【更に強力な名刺CRM】\n名刺撮影とアドレス帳登録に加え、名刺に文字、画像も追加可能、誕生日や訪問などのリマインドも設定でき、交渉と面会のプロセスをスマートに記録。地図で名刺の住所を位置付けや該当住所の付近の連絡先も確認でき、訪問ルートとビジネス日程管理が簡単に。人脈バンクの管理も更にスマートに！\n\n\n【高精度校正】\n高精度校正に送信すると、迅速に100%の名刺認識結果をフィードバック。高精度校正は、人工知能技術で名刺画像を認識し、必要に応じて、人的校正も実施。\n\n\n名刺認識管理(CamCard)を気に入っていただけましたら、或いはご意見がございましたら、少しお時間をいただき、名刺認識管理(CamCard)のご評価或いはisupport@intsig.comまでご連絡をお願いします。商品の改善へのご協力により更に多くの優れた機能を体験していただけますよう努力して参ります。\n\n\n\n-------アドバイス-------\n弊社製品ご使用の際に、よりよい効果を得るため：\n*画像が鮮明であればそれだけ認識精度も高まります。「明るい場所で、極力手ぶれの少ない状態で撮影してください」\n*画像が大きければそれだけ認識精度も高まります。「撮影する際には画像が大きくディスプレイに表示されるようにしてください」\n\n\n\n-------弊社の他のアプリケーション-------\n\n\n\n------- CamScanner \n\n\n* App Store2011年度セールスナンバー１アプリケーション\n* App Store2012年度セールスナンバー１有料アプリケーション\n* 全世界6000万人以上のユーザー、3000以上の教育機関、200以上の国・地域で使用されるスキャンアプリ！\n* ｢CamScannerは特別な画像処理技術でドキュメントがより読みやすくなる｣—Makeuseof.com\n* ｢間違いなくCamScannerは携帯電話で一番のスキャナーアプリ｣—CNET.com\n* iPhoneトップ50アプリの一つ―アメリカ「タイム」\n\n\n\n-------CamDictionary\n*  App Store2011年度ナンバーワン人気辞書/辞典アプリケーション\n*  App Store 2012年度ナンバーワン有料アプリケーション', '2010-04-06 20:57:23', '2014-06-04 15:02:37')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:02:39 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('302955766', 'JP', 'com.weathernews.weather', 'ウェザーニュース タッチ', 'http://a1884.phobos.apple.com/us/r30/Purple4/v4/43/2d/81/432d8173-ed88-6ebb-5f30-b6079b68f69d/mzl.xvbzvfbu.53x53-50.png', 'http://a400.phobos.apple.com/us/r30/Purple4/v4/43/2d/81/432d8173-ed88-6ebb-5f30-b6079b68f69d/mzl.xvbzvfbu.75x75-65.png', 'http://a781.phobos.apple.com/us/r30/Purple4/v4/43/2d/81/432d8173-ed88-6ebb-5f30-b6079b68f69d/mzl.xvbzvfbu.100x100-75.png', '0.00000', 'JPY', 'Weathernews Inc.', 'iOS_Apps', '6001', 'topgrossingapplications', 0, 'ようこそ、みんなで作る天気予報の世界へ！\n\nウェザーニュースタッチは、天気・季節・減災などの専門気象情報はもちろん、 いまこの瞬間のリアルタイムの空がわかる究極の天気予報アプリ（無料）です。\n \n全国600万人のウェザーリポーターから送られてくるリポートによって、 刻々と変わる「空の様子」や、周辺の人々の「体感」が手に取るようにわかります。 また、「ソラサーチ」という機能を利用すれば、 今あなたがいる場所に今後降ってくる雨の影響を 現地のリポートを元に詳細に知ることができます。\n 天気予報の精度は､観測データの量によって決まります｡ みなさんから寄せられる膨大な数のウェザーリポートは､ これまで150年間大きく変わらなかった天気予報の精度向上に 大きな一歩を踏み出しています｡\n このように、ウェザーニュースタッチは、従来の天気予報の限界を超えて、 詳細で正確な天気予報をみんなのチカラで創る全く新しいアプリなのです。\n\n 【よくあるお問い合わせ】\n 多く頂いたご意見につきまして、設定方法をお知らせ致します。 もっと便利に・もっと楽しくウェザーニュースタッチをご活用ください。\n\n ◆常にONになっているGPS機能を停止するには？\n 　マイページのソラミッション通知設定や、スマートアラーム設定をOFFにすると、\n 　GPS機能を停止することができます。その場合、エリア限定で配信される災害情報など、\n 　各種通知サービスがご利用頂けなくなりますので、ご注意ください。\n\n ◆起動画面を「天気予報Ch.」（ピンポイント天気）にするには？\n 　１）「天気予報Ch.」をMyスクリーンに登録\n 　　起動時に表示したい画面を開き、ツールバーの「＋」をタップします \n　２）「AllCh.」から「MyCh.」を立ち上げます\n 　　「編集」から「起動時の画面を設定」をタップ。\n 　　表示したい画面の上部にある「HOME」をタップすることで設定いただけます。\n 　※この方法で、天気予報Ch.以外にもお気に入りのChを起動画面に設定することができます。\n\n ◆ツールバーに「MyCh.」を設定するには？ \n　１）ツールバーの一番右にある六角形のアイコンを長押しします。\n 　２）「MyCh.」と「TOPのソラピース」のアイコンが表示されます。\n 　 　　「MyCh」アイコンを選択すると、ツールバーに「MyCh.」を設定できます。\n\n 【究極の天気予報アプリ】\n ウェザーニュースタッチには、定番の気象メニューが充実。 気象のエキスパート４００名が支えるお天気サイトの決定版です。\n ◆全２５チャンネルがあなたの生活を全力サポート\n 　▼ALL Ch.\n 　・今日明日週間の天気（天気予報、１０分天気予報）\n 　・気象災害対策Ch（地震、津波、台風、ゲリラ雷雨、警報注意報など）\n 　・専門気象Ch（雨雲レーダー、衛星、天気図、ライブカメラなど）\n 　・季節情報Ch（星空、さくら、花粉、花火、紅葉、スキー＆スノボ）\n 　・24時間生放送で天気を伝える動画番組Ch（SOLiVE24）\n◆スマートアラーム(通知サービス)\n 　スマートアラームの設定をONにしておくだけで、GPSによる位置情報をもとに、\n 　今いる場所の最新の気象情報を入手できます。\n 　 　(なお、バックグラウンドで位置情報(GPS)の利用は、バッテリーの消費量が大きくなる場合がありますのでご注意ください。)\n ◆ウェザーニュース会員（有料）登録について \n　スマートアラームやソラトモ機能など有料オプションの機能をご利用頂くには、「ウェザーニュース会員」（有料）をアプリケーション内でご購入手続きください。\n 　会員登録はご購入頂いた期間有効です。期間内に追加購入頂きますと、その期間分が加算されます。\n 　期間途中での解約に際し、返金は致しかねますのでご了承ください。\n 　自動更新にて、「ウェザーニュース会員」をご利用いただいている方へ\n - １ヶ月ごとの自動更新となります。\n - 月額 300 円です。\n - お支払いは iTunes よりご利用いただきます。\n - 現在有効期間満了の少なくとも24時間以上前に、自動更新を停止しない限り、自動的に更新されます。\n - ご購入後、[設定] - [iTunes Store/App Store] - [Apple ID] - [購読] の項目より、いつでも自動更新を停止していただくことができます。\n - 期間の途中で自動更新を停止していただいても、残りの有効期間については引き続きお使いいただけます。\n - 他のお支払い方法により、有効な期間が残存しているときに、新規に自動更新をご登録いただいた場合は、その残存期間については無効とさせていただきます。ご注意ください。', '2009-01-24 07:26:15', '2014-06-04 15:02:39')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:02:43 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('657795287', 'JP', 'com.square-enix.dqxtools', 'ドラゴンクエストⅩ　冒険者のおでかけ便利ツール', 'http://a564.phobos.apple.com/us/r30/Purple/v4/da/01/30/da013058-4c10-e3f2-a433-7c51b77e73f5/mzl.ahuqhfny.53x53-50.png', 'http://a1080.phobos.apple.com/us/r30/Purple/v4/da/01/30/da013058-4c10-e3f2-a433-7c51b77e73f5/mzl.ahuqhfny.75x75-65.png', 'http://a805.phobos.apple.com/us/r30/Purple/v4/da/01/30/da013058-4c10-e3f2-a433-7c51b77e73f5/mzl.ahuqhfny.100x100-75.png', '0.00000', 'JPY', 'SQUARE ENIX INC', 'iOS_Apps', '6002', 'topgrossingapplications', 0, '================================\nドラゴンクエストⅩプレイヤー専用アプリです\n================================\n\n\n※※　はじめにご確認ください　※※ \nお使いの端末が以下のいずれかに当てはまる場合、アプリが正常に動作しない場合がございます。 \n\n・OSのバージョンが古い端末の場合\n・改造端末の場合\n・以下のような解析がされた端末の場合\n ---ソフトウェアの改造 \n ---ルート化等を含む解析\n ---リバースエンジニアリング\n ---逆コンパイル、または逆アセンブル　等\n\n\n【ご利用いただける機能】 \n『ドラゴンクエストⅩ』の世界をより一層お楽しみいただける『ドラゴンクエストⅩ　冒険者のおでかけ便利ツール』です！ \nこのアプリには、ゲームをしていないおでかけ先でも使える「ちょっと便利な機能」が搭載されています。 \n\n\n■キャラクター情報確認機能 \n自分のキャラクターの装備やパラメーターなどのプロフィール情報を確認できます。 \n\"サポート仲間雇われ情報\"やドラゴンクエストⅩ内でフレンド登録した相手キャラクターの状態が確認できる\"フレンド確認機能\"はもちろんのこと、その他にも、\"キャラクターの3D表示機能\"や、ドラゴンクエストⅩ内で所属しているチームの情報が確認できる\"チーム情報確認機能\"などの機能をお使いいただけます。 \n\n■郵便局機能 \n自分のフレンド宛てに手紙を送ることができます。また、郵便局に届いたお届け物も確認することができます。  \n\n■旅人バザー閲覧機能 \n「旅人バザー」に出品されているアイテムを条件をつけて検索したり、自分が出品しているアイテムの情報を確認することもできます。 \n\n■おしらせ確認機能 \nゲーム内での『ドラゴンクエストⅩ』運営スタッフからのお知らせを確認できます。\n\n■ライブカメラ \n「ドラゴンクエストⅩ」の世界がライブカメラ画像として映しだされます。画像は数十秒に一度更新されます。 \n\n■思い出アルバム \n「ドラゴンクエストⅩ」の世界で撮影した思い出アルバムの写真をおでかけ先で確認することができます。 \n\n\n■Ver2.0.1以降の新機能\n・チームクエスト閲覧機能の追加\n・元気チャージを元気玉に交換できる機能の追加\n・キャラクターの持ち物を確認できる機能の追加\n・ゴールド銀行からのゴールドの引き出し、預け入れができる機能の追加\n・郵便箱の手紙、アイテム、ゴールドを受け取る機能の追加\n・バザーの出品とりやめ機能の追加\n・プレミアムコンシェルジュ機能の追加\n\n\n≪プレミアムコンシェルジュについて≫\nプレミアムコンシェルジュでは以下のサービスがご利用いただけます。\n\n【こちらは有料のサービスになります】\n\n------------------------\n\n◆畑のお世話\nおでかけ便利ツール上から「ドラゴンクエストⅩ」内の畑に水をあげることができます。ご自身のキャラクター以外にフレンド、チームメンバー、自宅のご近所の方にも水をあげることができます。\n\n※畑のお世話機能に関しては「ドラゴンクエストⅩ」にログインした状態でもご利用いただけます。\n\n◆バザー落札\n旅人バザーに出品されているアイテムを、おでかけ便利ツールより落札することができます。\n\n◆バザー出品\n「ドラゴンクエストⅩ」内でお持ちのアイテムを、おでかけ便利ツール上から旅人バザーに出品することができます。\n\n◆元気玉をふくびき券に交換できるサービス\n「ドラゴンクエストⅩ」内でお持ちの元気玉・小元気玉・超元気玉を、元気玉の種類に応じた枚数のふくびき券に交換することができます。\n\n※ただし、一度に交換できるふくびき券は99枚です\n\n◆酒場サービス\nおでかけ便利ツール上からサポート仲間を雇うことができます。酒場サービスは町や村、キャンプ地、住宅村などフィールドやダンジョン以外の場所で「ドラゴンクエストⅩ」のゲームをログアウトしている場合にご利用いただけます。\n\n◆ふくびき所\nおでかけ便利ツール上から、「ドラゴンクエストⅩ」内でお持ちのふくびき券またはふくびき補助券を使用して、お好きな大陸のふくびき所をご利用いただけます。\n※「冒険者の便利ツール専用ふくびき所」もございます。\n\n------------------------\n\n\n≪ご注意≫\n\n※プレミアムコンシェルジュ機能をご利用の際には『ドラゴンクエストⅩ　冒険者のおでかけ便利ツール』上でのみ使用できる仮想通貨「ジェム」が必要となります。\n\n※ジェムはアプリ内のショップよりお買い求めいただけますが、初回サービスとして500ジェムをご利用のアカウント毎にプレゼントしております。また、毎日おでかけ便利ツールを起動するたびにもらえるデイリーボーナスもご用意しておりますので、無料でプレミアムコンシェルジュ機能をお使いいただくことも可能です。\n\n\n■お客様へのお願い\nお客様が「ドラゴンクエストⅩ」をよりお楽しみいただけるよう、本アプリの品質向上に努めておりますが、特定の端末でのみ発生する固有の不具合など原因調査が難しいものも多く、改善のためにお客様からの情報提供を必要としております。\n\nレビュー等の内容では原因特定に至らない場合も多いので、もし不具合が見つかりました際には、ぜひとも弊社サポートセンターまで詳細情報をご提供いただけますと幸いです。\n\n※アプリに関しての不具合やお問い合わせは\n　下記URLもしくはアプリ内からお問い合わせください。\n　スクウェア・エニックスサポートセンター\n　http://support.jp.square-enix.com/main.php?la=0&id=7901\n\n【使い方】 \n本アプリをご利用になるためには、「ドラゴンクエストⅩ　目覚めし五つの種族　オンライン」をオンラインモードでプレイしている「スクウェア・エニックス　アカウント」が必要です。 \n\nアプリを起動した後に、「はじめる」→「新しくキャラクターを登録」をお選びいただき、「スクウェア・エニックス　アカウント」を入力の上、「おでかけ便利ツール」に登録したいキャラクターを選択してください。 \n\n\n【ご注意】 \nおでかけ便利ツールに登録できるキャラクターは1キャラクターです。ただし複数キャラクターをお使いの方も、登録キャラクターを変更することで、おでかけ便利ツールをお使いいただけます。 \n　 \n登録しているキャラクターの変更をするためには、画面右上にある 「編集」ボタンを押し、キャラクター削除した後に再度キャラクター登録を行ってください。 \n\nまとめて複数キャラクターを登録しておきたい方のために、キャラクター登録チケットをアプリ内で販売いたします。一度このチケットをご購入いただければ、登録可能キャラクター数を最大限の10キャラクターまで増やせます。 \n\n【対応機種】 \niOS 5以上の機種 \n\n※OSのバージョンが古い場合、 \n　 正常に動作しない場合があります。 \n\n\n【非推奨機種】 \niPhone3GS \n\n※アプリが動かなくなった場合 \n　 バックグラウンドで起動しているアプリを \n　 完全に終了させて再度起動してください。 \n　 (操作方法についてはご使用の端末の \n　　マニュアル等をご参照ください。）', '2013-07-27 02:34:53', '2014-06-04 15:02:43')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:02:45 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('382069612', 'JP', 'se.resenatverket.FlightRadar24', 'Flightradar24 Pro', 'http://a158.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.53x53-50.png', 'http://a1026.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.75x75-65.png', 'http://a1983.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.100x100-75.png', '300.00000', 'JPY', 'Flightradar24 AB', 'iOS_Apps', '6003', 'topgrossingapplications', 0, 'あなたの携帯やiPadをエアートラフィックレーダーに変えて、日本の周りや世界中を飛ぶ飛行機をリアルタイムで詳細な地図上で見てみましょう。アップル機器を空を飛んでいる飛行機にかざして、行き先その他を調べましょう。何百万人ものひとがなぜ Flightradar24を愛用しているのか。今日、ご自分で体験してみませんか。\n\nFlightradar2 アプリが25カ国以上でベストセラーとなった、また140カ国以上 (日本、米国、英国、ドイツその他) でベストセラーの旅行アプリとなった優れた機能には以下があります: \n* 詳細な地図上を飛行機が移動するのをリアルタイムでご覧になれます\n* 機器を空にかざすだけで、上空を飛んでいる飛行機を識別できます (GPS 搭載の機器が必要です)\n* 飛行機のパイロットがなにを見ているか、リアルタイムで 3Dで体験できます (iPhone 4S, iPad 2, iPod Touch 第5世代、+ iOS 6.0 以降のバージョンが必要となります)\n* 飛行機をタップすると、ルートや予想到着時間、実際の離陸時間、機種、速度、高度や高解像度の画像といった、全体的なフライトと機体の情報が表示されます\n* 便名や空港、航空会社で、個別のフライトを簡単に探せます\n* 航空会社、期待、高度、速度その他で簡単にフィルタリングできます\n* 簡単にお気に入りに追加でき、関心のある地域を迅速にナビゲーションできます\n* 機器を主要な航空の発着案内に合わせると、リアルタイムでフライトステータス更新と、現在の空港周辺の天候条件を見ることがをできます (アプリ内で別途ご購入いただいた場合)\n* リアリスティックな機体の記号 (アプリ内で別途ご購入\n* 航空会社、機種、便名または登録に基づいたカスタマイズされたアラートを設定する(アプリ内で別途ご購入) \n\nどのように機能するか\n今日、ほとんどの機体には、いわゆる位置データを送信する、いわゆるADS-Bのトランスポンダーが搭載されています。Flightradar24 は急成長中のネットワークで、世界中に数千のグループステーションを持ち、アプリ内の地図で機体が移動するのを示すこのデータを受け取ります。マルチラテレーションの助けを借りて、Flightradar24 はカバーする地域を拡大中であり、 ADS-B トランスポンダーを持たない機体の位置も計算可能となっています。\n\nアプリでは、米国連邦航空局 (FAA) からの直接的な情報供与により、従来のレーダーデータも利用されています。このデータは、米国とカナダの全空域をほぼリアルタイムでカバーします。\n\n***重要な通知***\nFlightradar24 アプリは英語で表記されています。が、テキストはほとんどなく、追加テキストが必要な際にも可能な限り周知の記号を使っています。\n\n特別の地域の飛行機の往来追跡にのみご興味がある場合には、アプリをご購入前に Flightradar24.com にてご確認ください。Flightradar24 は、他に類を見ないレベルの世界中の機体位置データを提供していますが、カバーされていない地域もあります。 \n\nカバレッジは随時変更される場合があります。\n\nFLIGHTRADAR24 にコネクトしよう\nFlightradar24 を Facebook でイイネ！して、Twitter でフォローしよう。\n\nヘルプ & サポート\nforum.flightradar24.com/threads/89-Important-Read-this-before-you-ask-questions\nflightradar24.com/contact-us.\n\n免責\nこのアプリの使用は、厳密に娯楽目的に限られています。特に、あなた自身や他の人々の命にかかわるような活動は、使用目的から除外します。いかなる状況においても、このアプリの開発者は、データの使用や解釈により、または本同意に反する使用から起こる事柄に対し、責任を負いません。弊社は、アプリ内のユーザーの活動を匿名で追跡・報告する権利を有します。', '2010-07-31 13:29:46', '2014-06-04 15:02:45')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
