):レース動画も見放題!\n\nレース動画のみの閲覧\n1レースあたり10円(税込)\n(購入日の翌々日24時まで閲覧可能)\n\n初回起動時にアンケートにご回答いただくと、4週間の無料お試し利用権が付与されます。\n\n※)アプリの再インストール等でチャージした金額が0になってしまった場合は、[設定]→[お問い合わせ]からサポートデスクにご連絡ください。履歴を確認してチャージ金額を復元いたします。\n\n■対応ハードウェア\niPhone(推奨:4以降)/iPod Touch(推奨:第3世代以降)\n\n■対応OS\niOS4/5/6/7\n\n■注意事項\n・本アプリケーションのご利用には、3G回線またはWi-Fiのインターネット接続が必要になります。', '2010-11-30 16:00:00', '2014-06-04 15:02:47')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:02:50 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('443904275', 'JP', 'jp.naver.line', 'LINE', 'http://a1314.phobos.apple.com/us/r30/Purple/v4/35/65/3b/35653b8e-3478-dcb0-51bc-9083d3473566/mzl.ounkyxry.53x53-50.png', 'http://a1830.phobos.apple.com/us/r30/Purple/v4/35/65/3b/35653b8e-3478-dcb0-51bc-9083d3473566/mzl.ounkyxry.75x75-65.png', 'http://a1715.phobos.apple.com/us/r30/Purple/v4/35/65/3b/35653b8e-3478-dcb0-51bc-9083d3473566/mzl.ounkyxry.100x100-75.png', '0.00000', 'JPY', 'NAVER JAPAN', 'iOS_Apps', '6005', 'topgrossingapplications', 0, '無料通話・無料メールアプリの決定版\n\nLINEは、24時間、いつでも、どこでも、無料で好きなだけ通話やメールが楽しめる新しいコミュニケーションアプリです。\n\n世界231ヶ国、登録ユーザー数4億5千万人突破! \n\n日本、タイ、台湾、スペイン、中国、インドネシア、シンガポール、香港、マレーシア、インド、スイス、サウジアラビア、メキシコ、ロシア、マカオ、アラブ首長国連邦など、世界52ヶ国のApp Storeで無料1位を記録!\n\n\n【LINEの新機能】\n\n◆ビデオ通話\n遠く離れた家族や友人との会話やビジネスミーティングに便利な「ビデオ通話」ができるようになりました。\n\n◆Snap Movie\nその瞬間をひとコマ動画で撮影して、BGMもつけて共有できる「Snap Movie」機能を追加しました。\n\n\n【LINEの主な特徴 】 \n\n◆スマホ同士なら、いつでも、どこでも無料の音声＆ビデオ通話\n・クリアな音声品質で好きなだけ長電話をしても無料です。\n・国際電話ももちろん無料！ \n\n◆サクサク簡単すぐ届く無料メール \n友だちとメールがわりに、サークルの仲間とMLがわりに。テキストだけでなく、絵文字や写真、地図も送れます。 \n・気持ちが伝わるスタンプ・絵文字を搭載 \n・動画や音声メッセージも簡単送信可能 \n・PCにも対応 \n\n◆より楽しく・便利に コミュニケーション \nタイムラインで、テキスト・写真・動画・スタンプ・位置情報などを使って、自分の近況をアップしたり、友だちの投稿をチェックできます。\n\n◆「スタンプショップ」でお気に入りを見つけよう！\n世界の人気キャラクターや、ちょっと笑えるシュールなキャラクターなど、表情豊かなスタンプを購入できます。\n\n◆便利な情報が届く「LINE公式アカウント」 \n「友だち」に追加するだけで、国内外の人気有名人からのメッセージや、企業からのお得なお知らせ･クーポンなどが届きます。\n\n\n※パケット通信料金がかかりますのでパケット定額サービスへの加入をおすすめします。\n\n【推奨環境変更のお知らせ】 \nLINE最新バージョン（3.1.3）から、LINEの推奨環境が変わりました。 \n\n- iPhone 3GS 以上 \n- iOS 4.3 以上 \n\nアプリのバージョンアップまたはLINEの新規インストールは上記の推奨環境で行ってください。 \n\nなお、古いバージョンのiOSのままiPhoneを使っている方は、最新版へのOSのバージョンアップをおすすめします。 \n\n▼iOSのバージョンアップ方法はこちら \nhttp://mb.softbank.jp/mb/iphone/support/os_update/how_to_update/ \n（ソフトバンク・KDDIどちらも同じ方法です）', '2011-06-21 16:00:00', '2014-06-04 15:02:49')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:02:51 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('586803362', 'JP', 'jp.monokakido.WISDOM2', 'ウィズダム英和・和英辞典 2', 'http://a926.phobos.apple.com/us/r30/Purple4/v4/ec/7f/0a/ec7f0aca-d100-98d7-2346-17d36dc99edc/mzl.xpvpyfbi.53x53-50.png', 'http://a1442.phobos.apple.com/us/r30/Purple4/v4/ec/7f/0a/ec7f0aca-d100-98d7-2346-17d36dc99edc/mzl.xpvpyfbi.75x75-65.png', 'http://a1999.phobos.apple.com/us/r30/Purple4/v4/ec/7f/0a/ec7f0aca-d100-98d7-2346-17d36dc99edc/mzl.xpvpyfbi.100x100-75.png', '2900.00000', 'JPY', '物書堂', 'iOS_Apps', '6006', 'topgrossingapplications', 0, '「ウィズダム英和・和英辞典 2」は、2012年11月に刊行された、三省堂「ウィズダム英和辞典 第3版」と「ウィズダム和英辞典 第2版」をセットにした電子辞典です。前作の「ウィズダム英和・和英辞典」と合わせて累計20万本以上販売されている App Store のベストセラー英和辞典アプリです。\n\n強力な用例検索機能によって、豊富な用例から的確な英語表現を見つけることができます。また、およそ15万の用例や約4万項目の音声データを含んでいるにも関わらず、インストール容量が約260MBと非常にコンパクトなのも特徴です。もちろんすべてのコンテンツがインストールされるため、使用時にネットワークに接続する必要はなく、オフラインで安心してお使いいただけます。\n\n主な機能は以下の通りです。\n\n- 物書堂独自のレイアウトエンジンによる高速表示\n- 前方、後方、完全一致検索\n- 成句・複合語検索\n- 日本語にも対応した用例検索\n- 複数項目による成句・用例のアンド検索\n- 和英・英和をまたいだ“なぞってジャンプ®”\n- 発音と例文の音声再生（英和辞典：約4万項目）\n- スペルミスの自動補正\n- コピー&ペースト（長押しでコピーすることができます）\n- 項目内検索\n- 項目内の重要語義や品詞や成句へのポップアップメニューによる簡易アクセス\n- スワイプによる前後の項目の表示\n- ブックマーク（日付や見出しでのソート、自由な並べ替え）\n- iCloudを使ったブックマークの同期（iSO6以降が必要です）\n- 表示履歴および検索履歴\n- iPadにも対応したユニバーサルアプリ\n- Retinaディスプレイ対応\n- インターフェースのカラー変更\n- 本文と一覧の文字サイズの変更、音量調整、画面回転のロック、検索文字消去\n- 検索画面を引っぱって消去\n- クリップボード検索\n- 他のアプリからの検索\n- 物書堂の他のアプリ（コウビルド英英、大辞林等）の呼び出し\n- ウィズダム英和・和英辞典からのブックマークの移行（v3.6以降のウィズダム英和・和英辞典のブックマーク画面からウィズダム２を選択してください）\n\nコンテンツについて\n\n◎ ウィズダム英和辞典 第3版\n\nコーパス（大規模英語データベース）を全面活用した、現代英語と語法に強い上級英和辞典、待望の改訂第3版。類義語解説・重要コロケーションなどを大幅増補し、項目数は類書中最大級の約10万2千項目。各種のコラムにより、日常学習・受験対策をあらゆる角度からサポート。重要な単語やイディオムについて約4万項目の音声を収録。\n\n- 項目数:約10万2千項目\n- 音声データ:約4万項目\n\n◎ ウィズダム和英辞典 第2版\n\n自然な英文を書き、英語による総合的な発信をサポートするための上級和英辞典、待望の改訂第2版。語の選択、文章の組み立て、模範例の提示という3つの面から、実際の英文作成を支援。項目数約9万、用例数約8万4千と増補。詳細な語法・類語解説のほか、まとまった文章を書くときに役立つ情報を満載。\n\n- 項目数：約9万項目\n- 用例数：約8万4千項目', '2012-12-29 16:00:00', '2014-06-04 15:02:50')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
