ップすると1段階ずつ縮小します。\n\n・ページをめくるには、左右端をタップしたり、ページをフリックして(指ではじいて)ください。\n\n・長押しにより記事の切り抜きができます。\n\n【ご利用環境等について】\n・紙面データのダウンロードは、3G/LTE回線でもできますが、Wi-Fi環境で行うことを推奨します。バックナンバー取得時も同様です。\n\n・アプリのバージョンをアップしたり、アプリを削除すると新聞データもなくなります。アップデート後は、通信の安定している場所で、再度紙面データを取得してください。\n\n・購読期間中は、なんらかの理由でアプリを削除されても、紙面購読の権利は継続されていますのでご注意ください。\n\n【休刊日等について】\n新聞の発行がない日は、更新はありません。夕刊フジは日曜のほか祝日や年末年始もお休みです。ご了承ください。', '2010-05-27 16:00:00', '2014-06-04 15:02:56')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:02:58 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('365876050', 'JP', 'jp.co.navitime.NAVITIME', 'NAVITIME - ナビ・地図・乗換・時刻表・運行状況・渋滞情報 旅行やビジネスに最適なナビタイム', 'http://a492.phobos.apple.com/us/r30/Purple6/v4/e8/47/4c/e8474cc3-95d9-f75a-9d50-2baa834b6459/mzl.tvsvmnmb.53x53-50.png', 'http://a1008.phobos.apple.com/us/r30/Purple6/v4/e8/47/4c/e8474cc3-95d9-f75a-9d50-2baa834b6459/mzl.tvsvmnmb.75x75-65.png', 'http://a1453.phobos.apple.com/us/r30/Purple6/v4/e8/47/4c/e8474cc3-95d9-f75a-9d50-2baa834b6459/mzl.tvsvmnmb.100x100-75.png', '0.00000', 'JPY', 'NAVITIME JAPAN CO.,LTD.', 'iOS_Apps', '6010', 'topgrossingapplications', 0, '【 毎月2,250万人が使ってます！ 】\n地図や乗り換え、徒歩のナビゲーションも！\nナビタイムならこれ一つであなたの移動を徹底サポート！\n\n◆◇◆ まずは無料お試し！◆◇◆\nNAVITIMEは地図や乗換案内、時刻表、徒歩の音声ルートに渋滞情報など、移動に役立つ様々な機能がご利用いただけます。\n\n・遅れる事無く時間通りにキッチリ移動したい。\n・知らない場所にも迷わず着きたい。\n・もっと効率的なルートを知りたい。\n\nナビタイムは、そんなご要望にお応えできる歩行者向け総合ナビゲーションアプリです。\n定期購読なら7日間無料でトータルナビなどの有料機能がお試しいただけます。\n\n*当社サービス全体の月間ユニークユーザ数合計（2014年3月時点）\n\n\n\n■NAVITIMEアプリの主な特徴(無料)\nダウンロードして直ぐにご利用いただける、無料の人気機能です。\n\n1.｢初めての駅でも安心！｣\n決め細やかな情報満載の｢乗り換え案内｣\n\n・乗車ホーム番号の表示\n・乗り換えに最適な乗車位置の表示\n・早い、安い、乗換の少ないルート表示\n・一本前後の乗り換え検索\n・路線図からの乗換案内\n(首都圏・東京地下鉄・関西・名古屋・札幌・仙台・福岡 エリアに対応)\n・駅出口番号や、改札を出てからの出口方向の表示\n・車いすやベビーカーに優しいエレベーター/エスカレーター優先検索\n・新幹線、特急利用などの条件設定\n・検索結果のブックマーク登録(画面メモの様に通信なしでルートを確認)\n\n\n2.｢行きたい場所が見つかる！｣\n700万件のお店/施設の検索\n\n・独自収集した全国700万件以上のスポット検索\n・(NEW!) 地下街や駅構内のお店もわかります\n・地図で表示した場所周辺の検索\n・予算や各種条件で絞り込めるグルメ検索\n・診療科目や今、診療可能な病院も探せる病院検索\n\n新規開店、閉店情報やこれからオープンする施設の情報も日々のメンテナンスを行い、新しい情報をご利用いただけます。\n\n\n3.見やすさ･情報更新にこだわった｢地図｣\n\n・年12回のメジャー更新をはじめ、毎月の独自メンテナンスで移り変わりの激しいスポットや道路情報もいち早く反映\n・(NEW!) \n　迷いやすい駅構内や地下街などの屋内地図も整備\n・直近1時間前後のリアルタイム降雨レーダー\n・細街路での一方通行表示や交差点名称表示\n・電子コンパス対応\n　(自分が向いてる方向に地図が回転します)\n\n\n4.｢お得に！便利に使いたい！｣\nクーポン検索・ホテル予約・特急券予約\n\n・ぐるなび、ホットペッパーのグルメクーポン\n・るるぶ、JTB、じゃらん、一休、楽天トラベル、日本旅行サイトへの有名宿泊施設への簡単予約\n・京成スカイライナーの予約や、JAL/ANA の航空券予約(乗換検索結果からご利用頂けます)\n\n\n5.｢カレンダー登録｣や｢ルート共有｣で\n日常利用も便利に\n\n・乗換ルート結果をカレンダーアプリに登録できるのでスケジュール管理に最適\n・ルート結果はメールやLineに転送できます\n\n\nその他人気の無料機能\n・｢LCC/格安ルートナビ｣格安航空会社や高速バスを使ったルート料金比較\n・都道府県別｢スポット検索ランキング｣\n・ユーザー投稿型の｢電車混雑リポート｣\n\n\n■プレミアムコースの主な特徴\nプレミアムサービスにご登録すると、安心して移動できる機能がご利用いただけます。\n\n6.初めての場所でも、時間通りに目的地へ行ける\n｢トータルナビ｣\n\nバスや電車・飛行機・車・歩きを考慮した、ドアtoドアの最適なルート案内ができます。\n・車ルートはタクシー料金/高速料金の表示\n・自転車ルートは起伏がわかる高低差グラフ表示\n・定期券を考慮した検索\n・屋根が多い道を優先した検索\n・路線バスや高速バス、新幹線などの路線も選択可能\n\n\n7.地図が苦手でも｢安心音声ナビ｣で目的地へ！\n\n徒歩のルートは、GPSを使った音声ナビで目的地までご案内します。\n右左折直進などの進行方向や、ルートから外れた場合でも細やかに音声で案内します。\n\n\n8.突然の列車事故でも\n｢運行情報｣と｢迂回ルート検索｣で目的地へ\n\n・全国の鉄道路線のリアルタイム運行情報\n・遅延/運休などのメール配信、Push通知機能\n・列車事故路線を避けた迂回ルート検索\n\n\n9.複雑な駅構内や地下街でもスムーズに移動できる\n｢屋内ルート案内｣(NEW!)\n\n・地上から地下街を通り、ターミナル駅や地下鉄駅の電車のホームまでのルート\n・電車の乗換の際のホームからホームや駅出口までのルート\n・地下街やターミナル駅の駅ビル内にある店舗へのルート などを表示\n\n\n10.渋滞情報(VICS)で、ドライブも快適\n\n・渋滞/規制などの道路情報をリアルタイム表示\n・地図や簡易マップで場所の確認も可能\n・日付を選択しての渋滞予測も可能\n\n\n11.PCサイトやiPadでも同じ情報が使えます\n\n・地点登録(My地点)\n・ルート検索履歴\n・お店、時刻表の検索履歴\n・定期券登録情報　など\n\nPC版ナビタイムやiPadなどタブレット端末でログインすれば、登録情報やプレミアム機能が追加料金なしで使えます。\n\n\n\n■こんな時に便利！ナビタイムの使い方\n\n・最適な出発時間も教えてくれる！\n何時に出発すれば、約束の時間に間に合うの？！\nそんな時は､到着時間を指定してのトータルナビ/乗換案内が便利です。\n到着時間から逆算してのルートも検索できるので、出発すべき時間が一発で分かります。\n\n・突然の遅延/運休でも移動に困らない！\nトータルナビ/乗換案内は、鉄道の遅延・運休路線を除外した迂回ルートを検索できるので、突然のトラブルでも安心です。\n迂回できる代替路線が無い場所でも、徒歩やバス・タクシーを駆使して、何としてでもあなたを目的地までご案内するのがトータルナビの強みです。\n\n・急な入用にも安心！\nちょっとした外出先や、旅行先の知らない場所でも､ナビタイムがあればスポット探しが捗ります｡\n今居る場所や、指定した場所周辺のコンビニ､ATM､飲食店をはじめ、いざという時に駆け込みたいトイレに至るまで、カテゴリやフリーワードで自在に検索できます。\n\n\n■検索できるスポットカテゴリ\nトイレ,映画館,病院,スタジアム,ホテル,ホームセンター,コンビニ,ショッピングモール,イオン,博物館,内科,スーパー銭湯,ボウリング場,郵便局,美術館,アウトレットモール,ブックオフ,ヤマダ電機,水族館,神社,避難場所,温泉,警察,交番,図書館,歯科,皮膚科,耳鼻科,道の駅,タクシー,ユニクロビックカメラ,焼肉,大学,高校,中学校,学校,市役所（他多数）\n\n■バスデータについて\n｢路線バス｣｢高速バス｣｢コミュニティバス｣｢深夜バス｣に対応しています。\n*対応バス会社はアプリ内でご確認ください。\nバスデータを導入している場合、トータルナビや乗換案内などのルート検索や、時刻表を確認することができます。\n\n\n\n\n【プレミアムコース（有料登録）について】\n\n1.定期購読:400円(税込)/月 \nこのコースは自動継続課金機能(Auto Renewable Subscription)を利用しています。 \n「利用規約に同意する」ことで、料金がiTunesアカウントに課金されルート検索等の機能をご利用頂けます。 \n自動更新される際の課金は、有効期間終了の24時間前から終了までの間に行われます。1ヵ月の料金は400円です。 \n自動更新の解除/設定は「設定」⇒「Store」⇒「Apple ID」⇒「購読 管理」⇒「自動更新」で変更できます。 \n有効期間終了の24時間以上前に「設定」から「自動更新をオフ」にすると自動更新の停止ができます。 \n\n2.チケット購入 \n利用期間に応じて以下の2コースから選べます。 \n(全て税込) \n180日(1,900円)、365日(3,500円) \n\n*1度のプレミアムコースのご登録で、iPhone/iPad両方のプレミアムコースがご利用いただけます \n\n\n\n■対応ハードウェア\niPhone4,iPhone4S,iPhone5/5S/5C,iPod touch,iPad3Gモデル\n*ユニバーサルアプリのため、iPadでも最適化された画面でご利用いただけます。\n\n\n■ご注意\n・iPod touch、iPad Wi-Fiモデル(GPS非対応)では、音声案内が正常に動作しない場合があります\n・カーナビサービスには対応しておりません。\n・携帯電話の｢NAVITIME ID｣ではログインできません。\n・最新バージョンのアプリは、iOS 7.0以降に対応しています。', '2010-04-20 16:00:00', '2014-06-04 15:02:57')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
