Error - 2014-06-04 15:03:02 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('680170305', 'JP', 'net.7minworkoutapp', '7 分間エクササイズ - 7 Minute Workout Challenge', 'http://a1237.phobos.apple.com/us/r30/Purple4/v4/d9/79/e9/d979e9d7-25ef-206f-cd4d-1f2a55d76fc8/mzl.oyljxfjm.53x53-50.png', 'http://a1753.phobos.apple.com/us/r30/Purple4/v4/d9/79/e9/d979e9d7-25ef-206f-cd4d-1f2a55d76fc8/mzl.oyljxfjm.75x75-65.png', 'http://a1958.phobos.apple.com/us/r30/Purple4/v4/d9/79/e9/d979e9d7-25ef-206f-cd4d-1f2a55d76fc8/mzl.oyljxfjm.100x100-75.png', '200.00000', 'JPY', 'Fitness Guide Inc', 'iOS_Apps', '6013', 'topgrossingapplications', 0, '「7 分間ワークアウト」はリサーチに基づいたワークアウトプログラムです。世界的なヒットを記録しています! \n\n論文誌 ACSM にも掲載され、ニューヨークタイムズによって人気を獲得した「7分間ワークアウト」はシンプルですが、効果的です。 \n\n30 秒間行うワークアウトを 10 秒間隔で行う 12 のエクササイズを研究者が厳選。休みを少なく入れた高集中トレーニングで、1 日のメタボリズムを高めることができ、7 分強の運動で、1 時間以上の運動量に匹敵する効果が得られます。 \n\n最も注目していただきたいのは、このエクササイズがとてもシンプルだという点です。特殊な機器は必要ありません。どこにいてもエクササイズできるのです! これで言い訳はできませんね。 \n\nこのアプリでは、研究によって裏付けられたワークアウトを行っていきます。効果を追跡し、ワークアウトを続けるうちにご褒美ももらえるようになっており、楽しく続けることができます。 \n\nアプリの機能: \n\n- おしゃれなデザイン \n- 男性と女性のトレーナーが、ビデオ、オーディオ、画像、テキストでエクササイズをご案内します \n- すべてのコンテンツが料金に含まれています (追加料金はかかりません。インターネット接続も必要ありません) \n- ウェイトトラッカーで体重を管理できます \n- アクティビティカレンダーでアクティビティを追跡できます \n- ワークアウトしながら、さまざまなアチーブメントをアンロックできます \n\n弊社はフィットネスのプロを集めアプリ開発を行っています。最高品質の製品をお届けすることに細心の注意を払っています。ご意見やご提案などは、お気軽にお寄せください。アプリは定期的に追加料金なしでアップデートしていただけます。', '2013-07-31 06:50:20', '2014-06-04 15:03:02')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
