analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:03:11 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('458301892', 'JP', 'jp.co.medica.ECGjapan', 'らくらく心電図トレーニング（英語モード付き）', 'http://a1552.phobos.apple.com/us/r30/Purple/eb/75/18/mzl.tcdtryzh.53x53-50.png', 'http://a420.phobos.apple.com/us/r30/Purple/eb/75/18/mzl.tcdtryzh.75x75-65.png', 'http://a769.phobos.apple.com/us/r30/Purple/eb/75/18/mzl.tcdtryzh.100x100-75.png', '7400.00000', 'JPY', 'MEDICUS SHUPPAN, Publishers Co.,Ltd.', 'iOS_Apps', '6020', 'topgrossingapplications', 0, '【Ver. 1.02】iOS5に対応!\r\nメディカルカテゴリ・トップセールスNo.1、1ヵ月連続獲得!\r\n\r\n6万人以上の医療者が利用した、画期的なモニター心電図トレーニングソフトが今、iPhone・iPad・iPod touchのアプリとなって登場。\r\n\r\n心電図読解の上達のヒケツは、波形のポイント・特徴を絞り込んで観察すること。\r\nこのアプリでポイントの絞り方を繰り返しトレーニングすれば、現場で役立つ力が必ずついてきます。\r\n\r\nまさにこれは画期的な学習スタイル。サイズ・スピード共に、実物さながらのリアルな波形を表示。\r\nさらに、全182問の心電図波形問題と事典数百ページがこの1本に含まれているから、絶対お得商品まちがいなし!\r\n\r\n研修医・看護師はもちろん救急救命士など多くの医療従事者の皆さん! このアプリで、不整脈診断の重要ツール”モニター心電図”のプロになり、不整脈診断・治療方針策定に活かしてください。\r\n\r\n■監修・編著・監訳:北里大学北里研究所病院 臨床教授 副院長 循環器内科部長 赤石 誠\r\n■制作協力・出題:国際医療福祉大学三田病院心臓病センター 准教授 栗田 康生\r\n\r\n●どこから始める? 活用方法はあなた次第!\r\n「読み方コツ事典」で基礎からじっくり学ぶもよし、「チャレンジアタック」でどんどん問題に挑戦するもよし。\r\nどこから始めても、関連項目や重要用語はワンクリックですぐ確認できます。\r\n\r\n●「索引検索」「所見検索」は事典がわりに大活躍!\r\n\r\n●英語モードも付いています。\r\n\r\n【収録内容】\r\n●●読み方コツ事典〈7項目〉●●\r\n\r\n■心電図を読むための基本スキル\r\n初学者でもわかる丁寧な解説で心電図を理解しよう。\r\n\r\n■波形からみる心臓のようす(3項目)\r\n心臓の動きをアニメーションでリアルに表現。心電図と重ねて見ることで心電図が好きになる。\r\n\r\n■不整脈の種類と波形の特徴\r\n不整脈をカテゴリー別に整理(臨床で現れるすべての波形を網羅したものではありません)。種類と波形をつなげてスッキリ。\r\n\r\n■心電図さまざまな用語\r\n判読に必要な用語を動画やイラストで徹底解説。リンク機能の充実で関連ページも一気にわかる。\r\n\r\n■索引検索\r\n不整脈の名称や症候をカンタン検索。動画とイラストで見て理解しよう。(日本語:50音順、English:ABC順)\r\n\r\n■所見検索\r\nRR間隔・心拍数・QRS・QRSがP波に続くの4項目を、所見に合わせて設定すると、該当する症候を一発表示。\r\n\r\n\r\n●●チャレンジアタック(全182問収載)●●\r\n\r\n初級・中級・上級の3段階設定でレベルにあわせた学習ができる。モニター心電図のアニメーション波形をすばやく判読し、波形名を選択肢からチェック。問題はランダム出題なので、くりかえし学習にピッタリの「チャレンジアタック」に今すぐトライ!', '2011-09-01 16:00:00', '2014-06-04 15:03:11')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
