エレクトリックギターのコードストロークが思いのまま。よく使われるコードのフィンガーピッキングパターンをプレイすることもでき、本物のギター同様に指で演奏できるノートビューも用意されています。\n• Smart Bassでは、アップライトやエレクトリック、シンセサウンドなど多様なベースを駆使してグルーブを生み出せます*。\n• Smart Drumでは、ドラム音源をグリッドにドラッグするだけでオリジナルのビートを刻めます*。\n\nジャムセッションでバンドを始めよう\n• iPad、iPhone、iPod touchをWi-FiやBluetoothでつなげば、最大3人の仲間と一緒に、本物のバンドのようなセッションやレコーディングを楽しめます。\n• テンポ、キー、拍子、コードは、バンドリーダーのデバイスに自動的に同期します。\n• Touch Instrumentでも、エレクトリックギターやボーカルなどの生楽器でもジャムセッションができます。\n• 各自の演奏が自動的にバンドリーダーのもとに集められるので、その場でミックスしてメンバー全員で聴くことができます。\n\nどこにいても曲がつくれる\n• Touch Instrumentの演奏、録音したサウンド、ループでつくったトラックを最大32トラックまで組み合わせて、アレンジやミキシングができます**。\n• ノートエディタを使えば、Touch Instrumentの録音を簡単に微調整できます。\n• 曲の中の再生したい部分だけを選んでトリミングや配置ができます。\n• ミキサーを使って各トラックのボリュームを微調整できます。ソロ、ミュート、パン、リバーブやエコーも設定できます。\n• プロが制作した250以上のループを、あなたのオリジナル曲のバックバンドのように使えます。\n\n曲を共有\n• iCloudを使えば、あなたが持っているすべてのiOSデバイス上でGarageBandの曲をいつでも最新の状態に保つことができます。\n• iPhone、iPad、iPod touch用のカスタム着信音や警告音を作成できます。\n• Facebook、YouTube、SoundCloudにあなたの曲を直接アップロードできます。\n• GarageBandから曲をそのままEメールで送れます。\n• あなたの曲を書き出して、MacやWindowsパソコンのiTunesライブラリに追加できます。\n\n* GarageBandの音源とサウンドのフルコレクションは、アプリケーション内で一度購入する必要があります。\n** 32トラックはA7チップを搭載したiOSデバイスで利用できます。16トラックはiPhone 4s以降、iPad（第3世代以降）、iPad 2、iPad mini、iPod touch（第5世代）で利用できます。', '2011-03-11 02:52:09', '2014-06-04 15:03:40')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
