Error - 2014-06-04 15:03:44 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('423526151', 'JP', 'jp.gnresound.mosquitone', '耳年齢チェック！', 'http://a1674.phobos.apple.com/us/r30/Purple/75/70/93/mzl.iwhllhej.53x53-50.png', 'http://a542.phobos.apple.com/us/r30/Purple/75/70/93/mzl.iwhllhej.75x75-65.png', 'http://a123.phobos.apple.com/us/r30/Purple/75/70/93/mzl.iwhllhej.100x100-75.png', '0.00000', 'JPY', 'GN Resound Japan K. K.', 'iOS_Apps', '6013', 'topfreeipadapplications', 0, '☆☆☆☆☆バージョンアップ情報☆☆☆☆☆ \n\n65万人の方に遊んでいただいている耳年齢 \nチェックゲームがバージョンアップ! \n新機能は目で観る耳年齢。音を周波数ごとに解析して、グラフに表示するので、様々な音を目で確認できます。 \nあなたがしゃべった声、手をたたいた音などリアルタイムにビジュアル表示します。 \nモスキート音が聞こえない方でも視覚的に \n鳴っていると分かるようになりました。 \n\n☆☆☆☆☆☆☆☆☆☆☆☆☆☆☆☆☆☆☆☆ \n\nVer2.0追加機能 \n\n1. メニュー追加 \n2. 「目で観て確認」機能追加 \n3. 聞こえのQ&A追加 \n4. モスキートキャラクター変更 \n\nVer2.0修正 \n1. ボタンを押した時の気になるぷちっと音を修正しました。 \n2. iOS5に対応しました。 \n\n補聴器メーカーのジーエヌリサウンドジャパンより耳年齢チェックゲームが登場! \n\n視力、身長、体重などと違い、意外に知っている人の少ない自分の聴力レベル。 \n人間の耳は20Hzから20,000Hzの周波数を聞き分けることができるといわれています。 \n聴力の低下は思いのほか早く、20代より徐々に始まるというのが定説です。 \n特に、周波数の高い音は年齢とともに徐々に聞きにくくなっています。 \n\n「モスキート音」をご存知ですか? \nもともとはイギリスのセキュリティーシステム用に開発され、 \n「大人には聞こえない携帯着信音」として日本でも密かなブームになっています。 \nモスキートゲームアプリケーションであなたの耳の実年齢をチェックしてみましょ \nう。 \n\n操作は簡単!アプリケーションをインストールして起動したら、 \nあなたが該当する年齢の「再生」ボタンを押すだけです。 \n\n※モスキートゲームは病院で行われている聴力検査とは異なり、 \nあくまでも簡易な耳年齢チェックゲームです。普段の会話でも \nよく聞こえない音がありご心配の場合には、耳鼻科医師にご相談ください。 \n※実際に会話での聞き取りに必要な音は250Hzから3,000Hzの \n周波数帯に集中しているため、日常生活の会話などで支障が出てくるのは \n健康なきこえの方で、50歳代前後からはじまるといわれています。', '2011-03-14 08:56:05', '2014-06-04 15:03:44')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
