Error - 2014-06-04 15:03:50 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('880570444', 'JP', 'jp.co.congre.myschedule.jsdt2014ipad', '第59回日本透析医学会学術集会・総会 My Schedule for iPad', 'http://a332.phobos.apple.com/us/r30/Purple4/v4/52/45/92/524592ee-8def-0417-e682-c9bf373cea4d/mzl.jrcorxke.53x53-50.png', 'http://a848.phobos.apple.com/us/r30/Purple4/v4/52/45/92/524592ee-8def-0417-e682-c9bf373cea4d/mzl.jrcorxke.75x75-65.png', 'http://a1421.phobos.apple.com/us/r30/Purple4/v4/52/45/92/524592ee-8def-0417-e682-c9bf373cea4d/mzl.jrcorxke.100x100-75.png', '0.00000', 'JPY', 'MICE One Corporation', 'iOS_Apps', '6020', 'topfreeipadapplications', 0, 'プログラム検索＆スケジュール登録システム「My Schedule」は、第59回日本透析医学会学術集会・総会用モバイルアプリケーションです。\r\n聴講したいセッションや演題を検索し自分のスケジュールとして登録することで、学術集会・総会期間中のオリジナル予定表が作成できます。\r\n登録したセッションの開始前にはアラートが表示されるので、うっかりセッションを聴き逃すことがありません。\r\n\r\n[第59回日本透析医学会学術集会・総会]\r\n  会  期：2014年6月12日（木）～15日（日）\r\n           ※6月12日（木）は、常任理事会、理事会、通常総会（評議員のみ出席）のみです。\r\n  会  場：神戸国際会議場・神戸国際展示場・神戸ポートピアホテル\r\n            ワールド記念ホール・クオリティホテル神戸\r\n\r\n---------------------------------------------------------------------\r\n\r\nGet the very latest news on the 59th Congress of the Japanese Society for Dialysis Therapy, find information on the sessions, and plan your entire visit with the official JSDT2014 mobile app! This new mobile app features everything you need to know about the 59th Congress of the Japanese Society for Dialysis Therapy, in the palm of your hand.\r\n\r\nApp features include:\r\n + View the detailed congress program, complete with session descriptions and schedules.\r\n + Browse or search the full schedule of programs by day, type or title.\r\n + See the list of speakers and find the sessions they will present.\r\n + Plan your own personal program and organize your schedule during the Congress.\r\n + Receive the very latest congress information, with comprehensive updates on JSDT2014.\r\n\r\n[The 59th Congress of the Japanese Society for Dialysis Therapy]\r\n  Dates: June 12 (Thu) - 15 (Sun), 2014\r\n  Venue: Kobe International Conference Center / Kobe International Exhibition Hall / \r\n            Kobe Portopia Hotel / World Hall / Quality Hotel Kobe\r\n\r\nKeyword: JSDT2014 jsdt2014\r\n\r\n---------------------------------------------------------------------\r\n本アプリの開発元、販売/サポートは以下の通りです。\r\n\r\n【開発・販売/サポート】\r\n株式会社 マイス・ワン\r\n    http://www.mice-one.co.jp/', '2014-05-29 05:12:35', '2014-06-04 15:03:50')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:03:52 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('509071750', 'JP', 'com.newton-jp.newtonfornewsstand', 'Newton International Edition', 'http://a238.phobos.apple.com/us/r30/Purple4/v4/99/18/01/99180108-2233-00d3-c83c-d86d8c776d90/mzl.kwnwvudf.53x53-50.png', 'http://a1106.phobos.apple.com/us/r30/Purple4/v4/99/18/01/99180108-2233-00d3-c83c-d86d8c776d90/mzl.kwnwvudf.75x75-65.png', 'http://a1615.phobos.apple.com/us/r30/Purple4/v4/99/18/01/99180108-2233-00d3-c83c-d86d8c776d90/mzl.kwnwvudf.100x100-75.png', '0.00000', 'JPY', 'Newton Inc. Apps.', 'iOS_Apps', '6021', 'topfreeipadapplications', 0, '******** 重要なお知らせ ********\n最新バージョンの Newton International Edition は，iOS6以降でご利用になれます。また，7月8日以降は，旧バージョンで記事のダウンロードができなくなりますので，アップデートをお願いいたします。ご不便をおかけし申し訳ありませんがよろしくお願いいたします。\n***\nアップデートを行うと，購入済の情報がリセットされる場合があります。その際は，お手数ですが「ライブラリ」画面右上の歯車マークをタップし，「すべての購入を復元する」を行ってください。\n********************************\n\n\n眼で見て,耳で聞いて,指でさわって楽しむことのできる,サイエンスマガジンがつくりたかった! それが,科学雑誌NewtonがiPad向けに創刊した「Newton International Edition」です。\n\n動画や音声, タッチ操作などをふんだんに取り入れながら, サイエンスを「なるほど!」と納得しながら, 楽しむためにiPad向けに特別に制作された, 待望のインタラクティブ・サイエンスマガジンです。\n\n-------\n特別増刊号『福島原発1000日ドキュメント』を刊行いたしました。発生から3年を迎えていまだに収束しない福島第一原発事故について、「あのときに何が起きたのか」「この3年間で何が行われてきたのか」をビジュアルに展開しています。原発のこれからを考える上での必携資料としてご活用ください。\n\n■ 福島第一原発の施設全体を3DCG化。制御棒の自動挿入による「原子炉の緊急停止」を動画で再現\n　科学雑誌『Newton』は、深刻な事故を起こした福島第一原発の施設全体を3DCGで再現しました。iPad版特別増刊号では、福島第一原発の施設全体を指でぐるぐるとまわしながら、くまなく観察することができます。\n　2011年3月11日午後2時46分、マグニチュード9.0の超巨大地震が発生し、福島第一原発を震度6強の強い揺れが襲いました。運転中だった1号機、2号機、3号機の原子炉は制御棒の自動挿入によって緊急停止しました。iPad版特別増刊号では、この緊急停止の様子がわかる動画が収録されています。\n\n■ 巨大津波の襲来からメルトダウンまでの一部始終を、動画とインタラクティブ・イラストで検証\n　地震によって送電鉄塔が倒壊し、配電設備も破壊されたことによって、各原子炉は外部電源を喪失し、非常用ディーゼル発電機が自動起動しました。そして、午後3時35分に襲来した巨大津波によって各原子炉建屋とタービン建屋が浸水し、非常用ディーゼル発電機も水没して機能を失いました。\n　こうしてすべての電源を失った1号機、2号機、3号機では、緊急停止後も熱を放つ核燃料の冷却手段が失われ、夜10時頃に恐れていた核燃料の溶融、すなわちメルトダウンが1号機ではじまりました。iPad版特別増刊号では、巨大津波の襲来と電源喪失、非常用冷却装置の停止、そしてメルトダウンへと至るまでの一部始終を動画で検証しています。\n\n■ 恐れていた「放射性物質の大量放出」が現実に。iPad版特別増刊号でその経緯が確認できます\n　1号機に続いて、2号機、3号機でも同様にメルトダウンが発生し、1号機、2号機、3号機の原子炉は破壊されて放射性物質が大量に放出されました。こうして発生した福島原発事故は、その後も事故を積み重ね、空・地下・海に放射性物質の漏洩汚染を続けています。\n　iPad版特別増刊号では、原子炉に閉じ込められていたはずの放射性物質が、いつ、どこから、どのようにして空・海・地下へと放出されたのかについて、その実態と実状を確認できます。\n\n＊ 『Newton International Edition』3月号の特集記事『過酷事故 連鎖の5日間 福島第一原発』は、特別増刊号『福島原発1000日ドキュメント』の一部を先行して掲載したものです。\n＊紙版のNewtonとは別に,iPad向けに制作したものです。\n\n--------\n\n■購読方法\n1号ごとの通常号の購入:500円(創刊号は無料)。\n1年間定期購読(自動継続):3000円。\n\n-自動継続は,購読期間終了の24時間以上前に自動更新設定をオフにすることで停止できます。\n-購読期間中は,期間の変更やキャンセルはできません。\n\n■記事の再ダウンロードについて\n各号をiPadから削除しても，一度購入した号は，何度でも無料で再ダウンロードすることができます。', '2012-05-16 16:00:00', '2014-06-04 15:03:52')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
