レス接続:異なる携帯電話、iPadやパソコンの間で名刺の管理、確認が可能。 \n* 自動バックアップ:WiFi使用時は自動でバックアップ。携帯電話を交換しても名刺情報を引き続き使用可能。 \n* 多種言語を認識:簡体中国語、繁体中国語、英語、日本語、韓国語、ドイツ語、フランス語、スペイン語、イタリア語、ハンガリー語、デンマーク語、スウェーデン語、ノルウェー語、オランダ語、ポルトガル語、フィンランド語。 \n\n• 名刺を一括認識:1回の撮影で連続撮影し、複数の名刺を自動で一括認識。\n• 名刺のQRCodeの認識、作成。 \n• 名刺情報をExcelやvCardファイルで気楽にエクスポート。 \n• 検索、ソート、グループ管理が可能。\n• 名刺のメモ情報を追加可能。 \n• 自分の名刺を作成して迅速に共有可能。\n\nカメラの効果制限の為、iPad2では名刺を直接撮影できません。携帯電話やデジタルカメラで名刺を撮影しiPadにインポートした上での認識となります。\n\nご意見がございましたら、少しお時間をいただき、名刺認識管理(CamCard)のご評価或いはisupport@intsig.comまでご連絡をお願いします。 \nFollow us on Twitter: @CamCardIntSig \nLike us on Facebook: CamCard \nFollow us on Google+: CamCard', '2012-06-05 04:53:14', '2014-06-04 15:03:57')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
