Error - 2014-06-04 15:04:05 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('498801050', 'JP', 'com.tapbots.TweetbotPad', 'Tweetbot ― 個性派Twitterクライアント (for iPad)', 'http://a1740.phobos.apple.com/us/r30/Purple/v4/d2/0e/c4/d20ec40f-a3a7-54b5-70be-beaa4894bf06/mzl.piselrjc.53x53-50.png', 'http://a256.phobos.apple.com/us/r30/Purple/v4/d2/0e/c4/d20ec40f-a3a7-54b5-70be-beaa4894bf06/mzl.piselrjc.75x75-65.png', 'http://a509.phobos.apple.com/us/r30/Purple/v4/d2/0e/c4/d20ec40f-a3a7-54b5-70be-beaa4894bf06/mzl.piselrjc.100x100-75.png', '300.00000', 'JPY', 'Tapbots', 'iOS_Apps', '6005', 'toppaidipadapplications', 0, 'Tweetbotは、iPad用の高機能型・個性派Twitterクライアント。細部まで綿密に作り込まれたインターフェースや、サウンドとアニメーション、マルチタイムラインやスマートジェスチャといった機能など、他にない魅力を満載したアプリです。\n\nTweetbot for iPadでは、iPhoneバージョンの特長に加え、さらなる魅力をプラス。\n\n主な特長: \n\n◆ マルチタイムライン:メインのタイムラインと複数のリストを、すばやく切り替え表示。 \n◆ スマートジェスチャ:手軽でカスタマイズ可能なジェスチャで、さくさくと操作可能。\n◆ 独自のプッシュ通知機能を搭載。 \n◆ タブバー右2つのタブは、表示内容を選択可能。未使用のタブにも簡単アクセス。 \n◆ Read It Later、Instapaper、URL短縮(Cloudapp他)などの各種サービスに対応。 \n◆ 下書きの保存、位置情報/POIサービスの利用、写真/ビデオの添付、リスト管理などの各種機能を搭載。\n\ntapbots.com/tweetbot/ipad/にて、Tweetbotの詳細をご覧いただけます。', '2012-02-09 04:29:58', '2014-06-04 15:04:05')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:04:08 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('576588894', 'JP', 'com.fifthstarlabs.skyguide', 'スカイ・ガイド – 星図', 'http://a513.phobos.apple.com/us/r30/Purple/v4/f9/c7/44/f9c744ab-3156-87a6-880d-56ac6ce25377/mzl.gehkirnd.53x53-50.png', 'http://a1381.phobos.apple.com/us/r30/Purple/v4/f9/c7/44/f9c744ab-3156-87a6-880d-56ac6ce25377/mzl.gehkirnd.75x75-65.png', 'http://a786.phobos.apple.com/us/r30/Purple/v4/f9/c7/44/f9c744ab-3156-87a6-880d-56ac6ce25377/mzl.gehkirnd.100x100-75.png', '200.00000', 'JPY', 'Fifth Star Labs LLC', 'iOS_Apps', '6006', 'toppaidipadapplications', 0, '星と星座のガイドが今までになく美しく、使いやすくなりました。空にかざすだけで自動的に恒星、星座、惑星、衛星などを見つけることができます。年齢や経験を問わず、すべての人が星を楽しく眺められるのがスカイ・ガイドです。\n \n「休みなく回り続ける恒星、惑星、衛星についてもっと詳しく知りたい人には、スカイ・ガイドが最高のアプリだ。」\n-CNET\n \nあれは恒星、それとも土星？ スカイ・ガイドの登場で、夜空のことを簡単に調べられるようになりました。iPhoneやiPadを空にかざすと、 スカイ・ガイドはあなたがどの星を見ているか自動的にわかってくれます。面倒なセットアップは全く必要ありません。\n \nおとめ座、アンドロメダ銀河、火星など、何を探すにしても、スカイ・ガイドがあなたの好奇心を満たします。幾千もの天体を検索することができて、ただ矢印を追うだけで実際の上空に見えるその星や星座などの正確な方向に案内してくれます。\n \n上空を通過する衛星を見てみたいと思ったことはありませんか？スカイ・ガイドでは、数百もの可視衛星を追跡できます。衛星の上昇や宇宙空間を通過する経路図を確認できます。衛星識別機能や、詳細な履歴情報、今後の上空通過時刻を提供するアドオンパックも別途ご利用できます。\n \n時間の早送り、巻き戻し機能を使って過去や未来の星空も探検できます。夜になったら月がどの位置にくるのかが前もって確認できるので、狙い通りの素敵な夜空の写真を撮ること等もできます。また、大型の彗星（すいせい）の接近を観察し、太陽を回り込むにつれ彗星の尾が発達していく様子を確認することもできます。\n \n従来の天文アプリとは違い、スカイ・ガイドは夢中になれるビジュアル重視の体験を提供します。アプリ開発者の一人が自ら撮影した極めて解像度の高い写真を使用しているため、模造した数千の点を集めた夜空の画像でない、何百万もの実写の星々を眺めることができます。またさらに、使用する場所の環境に合わせて、HDR輝度調節で星の光度を調整することもできます。\n \nスカイ・ガイドは少ないボタンで直感的な操作ながらも、コンテンツは盛りだくさんです。著名な天文書著者による豊富な説明や関連記事を多く含み、気軽な趣味・興味レベルで使いたい人からベテランの天文愛好家までがエンジョイできるものになっています。\n \nスカイ・ガイドはWi-Fi、データ、GPS信号の有無を問わず機能します。キャンプ先や海外でも使用できます。何時でも、どこでも、使い方も楽しみ方も自由且つ千差万別です。\n \nさらに、Mat Jarvisのデザインによるオリジナルサウンドや、暗闇に順応した目に優しいレッドナイトモードがあります。\n\n• リッチ コンテンツ: 多数の見事なグラフィック、オリジナルのアートワーク、および詳細な記事。\n• フィルター： X 線の空を観測して、目に見えない驚異を探索。\n \nご注意：スカイ・ガイドは、ジャイロスコープを必要とするため、iPad 1やiPhone 3GS以前の機種では機能しません。iPod Touchでは、使用前に手動で向きをキャリブレーションする必要があります。', '2013-05-07 04:45:52', '2014-06-04 15:04:07')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:04:10 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('777310222', 'JP', 'com.goodiware.goodreader4', 'GoodReader 4', 'http://a1852.phobos.apple.com/us/r30/Purple4/v4/ea/7d/3b/ea7d3b9e-3b09-8984-4555-6299fa05d55c/mzl.jwiwyxpq.53x53-50.png', 'http://a720.phobos.apple.com/us/r30/Purple4/v4/ea/7d/3b/ea7d3b9e-3b09-8984-4555-6299fa05d55c/mzl.jwiwyxpq.75x75-65.png', 'http://a989.phobos.apple.com/us/r30/Purple4/v4/ea/7d/3b/ea7d3b9e-3b09-8984-4555-6299fa05d55c/mzl.jwiwyxpq.100x100-75.png', '300.00000', 'JPY', 'Good.iWare Ltd.', 'iOS_Apps', '6007', 'toppaidipadapplications', 0, '--- INTRODUCTORY PRICE FOR A LIMITED TIME - ALMOST 60% OFF ---\n\nThis is the next generation of our famous GoodReader app, and now it\'s a universal app - one app for all your iOS devices.\n\nIn addition to all the features from the original GoodReader app, this upgrade includes the following awesome features:\n- PDF Page Management - add, rearrange, delete, rotate, extract and email individual pages, split and merge files\n- PDF Page Slider now shows page previews\n- icon view for file browser, with larger previews\n- collapsible tool area on the main screen\n- “New PDF” button to create an empty file for your important notes and drawings\n\n-------\n\nGoodReader® is the super-robust PDF reader app. Mashable describes it as “a Swiss Army knife of awesome!” Reviews worldwide hail it as “essential,” “the best,” “magnificent” and “the killer app”. With GoodReader on your iPad or iPhone, you can read virtually anything, anywhere: books, movies, maps, pictures. Use it once and you’ll be hooked. Soon you\'ll be wondering how you ever managed to go mobile without GoodReader.\n\nGoodReader has earned its accolades by the way it handles huge PDF and TXT files, manuals, large books, magazines, and renderings of 100 mb and more with great speed.\n\nThe ability to mark-up PDFs opens up new doors to GoodReader users who can now use typewriter text boxes, sticky notes, lines, arrows, and freehand drawings on top of a PDF file.\n\nAll the excelent features of the original GoodReader are here, including:\n- the best PDF reading engine\n- PDF Annotations - text boxes, popup comments (\"sticky notes\"), text highlights and markups, freehand drawings, lines, arrows, rectangles, ovals, etc.\n- access to various types of servers to store your data - Dropbox, OneDrive, Google Drive, box.com, WebDAV, SMB, AFP, FTP, SFTP\n- Auto Sync with remote servers\n\nOur well-crafted Migration Assistant will make the transition to this new app easy for you - all your files and setting from the old GoodReader app will be transferred with a click of a button.', '2014-05-08 07:40:17', '2014-06-04 15:04:09')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
