ア度の高い選手も生成されるとの情報も…!? \n色んなバーコードで選手の生成を試してみよう。 \n\n◆アバター要素も充実! \n選手のユニフォームや、チームのエンブレムを変更することが可能です。自分好みにチームを着飾ろう。 \n\n◆少しの時間でも楽しめる! \nゲームはほんの少しの空き時間でプレイが可能。通勤や通学、就寝前など自分のペースで楽しもう。 \n\n◆基本プレイは無料! \n一部有料コンテンツもございますが、継続して無料でサッカーゲームを楽しむことができます。 \n\n********************************* \n\nさあ、今すぐBFB（BARCODE FOOTBALLER）をダウンロードして、夢のスタークラブを創ろう!! \n\n※電波状況により、ゲーム初回起動時のダウンロードに数分かかる場合があります。 \nアプリを終了せず、ダウンロードが完了するまでお待ちください。 \n\n※快適にゲームをお楽しみいただくには、Wi-Fi環境でのプレイを推奨いたします。', '2012-12-12 12:53:12', '2014-06-04 15:04:34')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
