く閲覧するページをお気に入りアイコンで、3件まで登録できます。\n・登録したページはメニューに表示されます。\n\n情報提供:日本気象協会\n\nアプリケーションは無料でご使用いただけます。パケット通信を伴うネットワーク接続に関しましてはお客様のご負担となります。 \n\niPhone4(iOS5.0以上)、iPhone4S、iPhone5、iPhone5s,5c で動作します。\nオフライン(ネットワークに接続しない状態)では利用できません。 \nアプリケーションご利用の際にブラウザ、モバイル版「Safari」で「Yahoo!天気・災害 」ウェブサイトに接続されることがあります。', '2012-05-10 10:02:04', '2014-06-04 15:04:35')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
