ンツを楽しめます。 \n\n■ 好みのコンテンツを見つけたら『クリップ』して集め、『クリップブック』として編集して楽しむことができます。 \n\n\n【機能詳細】 　 \n1「クリップ」 \n・記事の右上もしくは右下についているクリップマークをタップすると、好きな記事や、後で読みたい記事をAntenna内にまとめて保存できます。 \n\n2「クリップブック」 \n・記事をまとめてオリジナルのブックを作成することができます。自分のために整理するもよし、同じテーマに関心がある人に公開するもよし！ \n\n3「シェア」 \n・充実の連携サービスで、伝えたい人に伝えたい情報を届けられます。 \n　連携サービス：Facebook、Twitter、LINE、カカオトーク、Evernote、Tumblr、Pocket、はてなブックマーク \n\n\nその他にもあなたの情報収集・情報発信・ショッピングを楽しむ方法は盛りだくさん。 \n随時Antenna運営チームがサポート記事を発信しますので、安心してお使いください。 \n\n\n【対応デバイス】 \nスマートフォン、タブレット、パソコンと幅広いデバイスで使うことができます。 \nアカウント作成により、同じ設定での情報収集・情報発信・ショッピングをお楽しみいただけます。 \n\n\n▽パソコン版 \nhttp://antenna.jp（アプリと同じアカウントで利用できます。） \n\n【公式Facebookページ】 \nAntennaで配信されている記事から、スタッフが厳選した情報を毎日配信中！ \nhttp://www.facebook.com/antenna.jp \n\n【サポートについて】 \nお問い合わせは、support@antenna.jpまでお気軽にご連絡ください。 \n\n【配信元メディア】 \n厳選した220以上のメディア情報を配信中！※2014/04/02時点 \nAntennaは配信元メディアとコンテンツ提供および配信に関して正式契約をしています。 \n\n------------------------ \nArtFM \nART and ARCHITECTURE Review \nART iT \nItmedia \niPadiPhoneWire \ni-VoCE \nあさこ食堂 \nAppBank \nアドタイ \nアプリソムリエ \nandronavi \nAndroWire \nunbar \nインテリア情報サイト \nインテリアハック \nWoman Apps Magazine \n旨い！ナポリピッツァ \nokmusicUP\'s \nocean+α（オーシャナ） \nAUTOCAR \nオートックワン \nOPENERS \nAll About News Dig \nオススメ・おでかけ・レストラン \nOZmall \nOZmall FOR MEN \nおたくま経済新聞 \n漢の粋 \nONLINEデジモノステーション \nカービュー \ncafeglobe \nカロンズネット \nギズモード \nグッズプレス \nクランクイン！ \nglitty \nGRIND \nCREA \nQetic \nCOCOmag \nココロニプロロ \nKOTAKU \nコロカル by マガジンハウス \nCONTRAST \nCyclist \nサッカーキング \nTHE FASHION POST \nさわあこのラジオ日記 \nCBC-NET \nJ-WAVE NEWS \ncinemacafe.net \nシネマトゥデイ \nSHIFT \n[渋谷&恵比寿]ランチ・ジャーナル \nShoeCream \n就職ジャーナル \n食＠新製品 \nJOSHI+ \nSHOT \nスイーツ番長 \nSUPER SWEETS \nSTYLE4 Design \nSocial Appli navi \nSpotLight \nスマ町銀座商店街～ニュース \n装苑 \nソフトニック \nダイヤモンド・オンライン \n旅キッズ \nダ・ヴィンチ電子ナビ \nTAB \nTABROID \n地球の歩き方 \nCharis \nDiginfo TV \nTechWave \n東京カフェマニア \n東京カレンダー \nTokyo Headphone Magazine \nTRAVELHACK \nTRENDYnet　モバイル \nナショナルジオグラフィック \n日経ウーマンオンライン \nNewSphere \n猫ジャーナル \nパーゴルフ \nhighfashion \n箱庭 haconiwa \nHellomag-ハロマグ- \nパンケーキ部 \nハンバーガーブログ \nぴあ映画生活 