ad ビジネスアプリ\n\n* iPad を使って PowerPoint、Keynote、Word、Excel、Outlook、Quicken、IE、Chrome、Safari その他の PC / Mac アプリケーションを含む、すべてのプログラムやファイルに 100% の互換性でアクセスします\n\n* Flash および Java に対応し、ブックマークすべて、お気に入りのプラグインすべてフルデスクトップブラウザ（IE、Chrome、Firefox）をお使いください\n\n* パソコンに保存したすべての映像と音楽、フォマット関係なくそのまま再生します\n\n* （World of Warcraft、StarCraft、Skyrim および Diablo III といった）3D ゲームや（FarmVille、CityVille といった)すべての Flash ゲームをプレイ\n\n* Apple Retina ディスプレイサポート（ネイティブ解像度使用時）で鮮明な体験が楽しめます\n\n===================================\nオプションの In-App 購読：\n\nAnywhere Access Pack をご購入いただくと、インターネット経由で、安全な高性能サーバーのグローバルネットワークからコンピューターにアクセス：\n–インターネット経由で、3G上で、ファイアーウォール内部から、など信頼性のあるアクセス\n– Wi-Fi や 3G上の変化するネットワーク状況下でストリーミング性能を最適化\n– 256 ビット AES 暗号化搭載の SSL 経由で安全を確保\n– $1.99 で毎月購読または $16.99 で年間購読\n\nConfigurable Shortcuts & Gamepad や Whiteboard を含む Productivity Pack： \n– Windows や Mac のアプリまたゲームを最もよく使う機能を割り当てたオンスクリーンショートカットで操作します。内蔵プロファイルはもちろん、ご自分でプロフィールを作成することもできます。\n– あらゆるライブリモートデスクトップ画面に注釈をつけます。プレゼンテーションや教室での授業に最適。\n– $1.99 で毎月購読または $16.99 で年間購読\n\n購読料金は iTunes アカウントを通じてクレジットカードで請求されます。現在の期間終了の少なくとも 24 時間前までにキャンセルしない場合は購読は自動的に更新されます。アクティブ期間中に購読をキャンセルすることはできません。購入後はアカウント設定で購読を管理してください。\n\n利用規約とプライバシーポリシーを http://www.splashtop.com/terms/splashtop でご覧ください。\n===================================\n\n注意：\n1. お使いの PC（Windows 7、Vista、XP）、Mac（Snow Leopard、Lion、Mountain Lion）または Linux （Ubuntu 12.04）上で Splashtop Streamer をインストール。www.splashtop.com から無料でダウンロード。\n2. 快適に利用していただくにはデュアルコア CPU をおすすめします。', '2010-08-27 16:00:00', '2014-06-04 15:04:56')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:04:59 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('302955766', 'JP', 'com.weathernews.weather', 'ウェザーニュース タッチ', 'http://a1884.phobos.apple.com/us/r30/Purple4/v4/43/2d/81/432d8173-ed88-6ebb-5f30-b6079b68f69d/mzl.xvbzvfbu.53x53-50.png', 'http://a400.phobos.apple.com/us/r30/Purple4/v4/43/2d/81/432d8173-ed88-6ebb-5f30-b6079b68f69d/mzl.xvbzvfbu.75x75-65.png', 'http://a781.phobos.apple.com/us/r30/Purple4/v4/43/2d/81/432d8173-ed88-6ebb-5f30-b6079b68f69d/mzl.xvbzvfbu.100x100-75.png', '0.00000', 'JPY', 'Weathernews Inc.', 'iOS_Apps', '6001', 'topgrossingipadapplications', 0, 'ようこそ、みんなで作る天気予報の世界へ！\n\nウェザーニュースタッチは、天気・季節・減災などの専門気象情報はもちろん、 いまこの瞬間のリアルタイムの空がわかる究極の天気予報アプリ（無料）です。\n \n全国600万人のウェザーリポーターから送られてくるリポートによって、 刻々と変わる「空の様子」や、周辺の人々の「体感」が手に取るようにわかります。 また、「ソラサーチ」という機能を利用すれば、 今あなたがいる場所に今後降ってくる雨の影響を 現地のリポートを元に詳細に知ることができます。\n 天気予報の精度は､観測データの量によって決まります｡ みなさんから寄せられる膨大な数のウェザーリポートは､ これまで150年間大きく変わらなかった天気予報の精度向上に 大きな一歩を踏み出しています｡\n このように、ウェザーニュースタッチは、従来の天気予報の限界を超えて、 詳細で正確な天気予報をみんなのチカラで創る全く新しいアプリなのです。\n\n 【よくあるお問い合わせ】\n 多く頂いたご意見につきまして、設定方法をお知らせ致します。 もっと便利に・もっと楽しくウェザーニュースタッチをご活用ください。\n\n ◆常にONになっているGPS機能を停止するには？\n 　マイページのソラミッション通知設定や、スマートアラーム設定をOFFにすると、\n 　GPS機能を停止することができます。その場合、エリア限定で配信される災害情報など、\n 　各種通知サービスがご利用頂けなくなりますので、ご注意ください。\n\n ◆起動画面を「天気予報Ch.」（ピンポイント天気）にするには？\n 　１）「天気予報Ch.」をMyスクリーンに登録\n 　　起動時に表示したい画面を開き、ツールバーの「＋」をタップします \n　２）「AllCh.」から「MyCh.」を立ち上げます\n 　　「編集」から「起動時の画面を設定」をタップ。\n 　　表示したい画面の上部にある「HOME」をタップすることで設定いただけます。\n 　※この方法で、天気予報Ch.以外にもお気に入りのChを起動画面に設定することができます。\n\n ◆ツールバーに「MyCh.」を設定するには？ \n　１）ツールバーの一番右にある六角形のアイコンを長押しします。\n 　２）「MyCh.」と「TOPのソラピース」のアイコンが表示されます。\n 　 　　「MyCh」アイコンを選択すると、ツールバーに「MyCh.」を設定できます。\n\n 【究極の天気予報アプリ】\n ウェザーニュースタッチには、定番の気象メニューが充実。 気象のエキスパート４００名が支えるお天気サイトの決定版です。\n ◆全２５チャンネルがあなたの生活を全力サポート\n 　▼ALL Ch.\n 　・今日明日週間の天気（天気予報、１０分天気予報）\n 　・気象災害対策Ch（地震、津波、台風、ゲリラ雷雨、警報注意報など）\n 　・専門気象Ch（雨雲レーダー、衛星、天気図、ライブカメラなど）\n 　・季節情報Ch（星空、さくら、花粉、花火、紅葉、スキー＆スノボ）\n 　・24時間生放送で天気を伝える動画番組Ch（SOLiVE24）\n◆スマートアラーム(通知サービス)\n 　スマートアラームの設定をONにしておくだけで、GPSによる位置情報をもとに、\n 　今いる場所の最新の気象情報を入手できます。\n 　 　(なお、バックグラウンドで位置情報(GPS)の利用は、バッテリーの消費量が大きくなる場合がありますのでご注意ください。)\n ◆ウェザーニュース会員（有料）登録について \n　スマートアラームやソラトモ機能など有料オプションの機能をご利用頂くには、「ウェザーニュース会員」（有料）をアプリケーション内でご購入手続きください。\n 　会員登録はご購入頂いた期間有効です。期間内に追加購入頂きますと、その期間分が加算されます。\n 　期間途中での解約に際し、返金は致しかねますのでご了承ください。\n 　自動更新にて、「ウェザーニュース会員」をご利用いただいている方へ\n - １ヶ月ごとの自動更新となります。\n - 月額 300 円です。\n - お支払いは iTunes よりご利用いただきます。\n - 現在有効期間満了の少なくとも24時間以上前に、自動更新を停止しない限り、自動的に更新されます。\n - ご購入後、[設定] - [iTunes Store/App Store] - [Apple ID] - [購読] の項目より、いつでも自動更新を停止していただくことができます。\n - 期間の途中で自動更新を停止していただいても、残りの有効期間については引き続きお使いいただけます。\n - 他のお支払い方法により、有効な期間が残存しているときに、新規に自動更新をご登録いただいた場合は、その残存期間については無効とさせていただきます。ご注意ください。', '2009-01-24 07:26:15', '2014-06-04 15:04:59')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:04:59 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('657795287', 'JP', 'com.square-enix.dqxtools', 'ドラゴンクエストⅩ　冒険者のおでかけ便利ツール', 'http://a564.phobos.apple.com/us/r30/Purple/v4/da/01/30/da013058-4c10-e3f2-a433-7c51b77e73f5/mzl.ahuqhfny.53x53-50.png', 'http://a1080.phobos.apple.com/us/r30/Purple/v4/da/01/30/da013058-4c10-e3f2-a433-7c51b77e73f5/mzl.ahuqhfny.75x75-65.png', 'http://a805.phobos.apple.com/us/r30/Purple/v4/da/01/30/da013058-4c10-e3f2-a433-7c51b77e73f5/mzl.ahuqhfny.100x100-75.png', '0.00000', 'JPY', 'SQUARE ENIX INC', 'iOS_Apps', '6002', 'topgrossingipadapplications', 0, '================================\nドラゴンクエストⅩプレイヤー専用アプリです\n================================\n\n\n※※　はじめにご確認ください　※※ \nお使いの端末が以下のいずれかに当てはまる場合、アプリが正常に動作しない場合がございます。 \n\n・OSのバージョンが古い端末の場合\n・改造端末の場合\n・以下のような解析がされた端末の場合\n ---ソフトウェアの改造 \n ---ルート化等を含む解析\n ---リバースエンジニアリング\n ---逆コンパイル、または逆アセンブル　等\n\n\n【ご利用いただける機能】 \n『ドラゴンクエストⅩ』の世界をより一層お楽しみいただける『ドラゴンクエストⅩ　冒険者のおでかけ便利ツール』です！ \nこのアプリには、ゲームをしていないおでかけ先でも使える「ちょっと便利な機能」が搭載されています。 \n\n\n■キャラクター情報確認機能 \n自分のキャラクターの装備やパラメーターなどのプロフィール情報を確認できます。 \n\"サポート仲間雇われ情報\"やドラゴンクエストⅩ内でフレンド登録した相手キャラクターの状態が確認できる\"フレンド確認機能\"はもちろんのこと、その他にも、\"キャラクターの3D表示機能\"や、ドラゴンクエストⅩ内で所属しているチームの情報が確認できる\"チーム情報確認機能\"などの機能をお使いいただけます。 \n\n■郵便局機能 \n自分のフレンド宛てに手紙を送ることができます。また、郵便局に届いたお届け物も確認することができます。  \n\n■旅人バザー閲覧機能 \n「旅人バザー」に出品されているアイテムを条件をつけて検索したり、自分が出品しているアイテムの情報を確認することもできます。 \n\n■おしらせ確認機能 \nゲーム内での『ドラゴンクエストⅩ』運営スタッフからのお知らせを確認できます。\n\n■ライブカメラ \n「ドラゴンクエストⅩ」の世界がライブカメラ画像として映しだされます。画像は数十秒に一度更新されます。 \n\n■思い出アルバム \n「ドラゴンクエストⅩ」の世界で撮影した思い出アルバムの写真をおでかけ先で確認することができます。 \n\n\n■Ver2.0.1以降の新機能\n・チームクエスト閲覧機能の追加\n・元気チャージを元気玉に交換できる機能の追加\n・キャラクターの持ち物を確認できる機能の追加\n・ゴールド銀行からのゴールドの引き出し、預け入れができる機能の追加\n・郵便箱の手紙、アイテム、ゴールドを受け取る機能の追加\n・バザーの出品とりやめ機能の追加\n・プレミアムコンシェルジュ機能の追加\n\n\n≪プレミアムコンシェルジュについて≫\nプレミアムコンシェルジュでは以下のサービスがご利用いただけます。\n\n【こちらは有料のサービスになります】\n\n------------------------\n\n◆畑のお世話\nおでかけ便利ツール上から「ドラゴンクエストⅩ」内の畑に水をあげることができます。ご自身のキャラクター以外にフレンド、チームメンバー、自宅のご近所の方にも水をあげることができます。\n\n※畑のお世話機能に関しては「ドラゴンクエストⅩ」にログインした状態でもご利用いただけます。\n\n◆バザー落札\n旅人バザーに出品されているアイテムを、おでかけ便利ツールより落札することができます。\n\n◆バザー出品\n「ドラゴンクエストⅩ」内でお持ちのアイテムを、おでかけ便利ツール上から旅人バザーに出品することができます。\n\n◆元気玉をふくびき券に交換できるサービス\n「ドラゴンクエストⅩ」内でお持ちの元気玉・小元気玉・超元気玉を、元気玉の種類に応じた枚数のふくびき券に交換することができます。\n\n※ただし、一度に交換できるふくびき券は99枚です\n\n◆酒場サービス\nおでかけ便利ツール上からサポート仲間を雇うことができます。酒場サービスは町や村、キャンプ地、住宅村などフィールドやダンジョン以外の場所で「ドラゴンクエストⅩ」のゲームをログアウトしている場合にご利用いただけます。\n\n◆ふくびき所\nおでかけ便利ツール上から、「ドラゴンクエストⅩ」内でお持ちのふくびき券またはふくびき補助券を使用して、お好きな大陸のふくびき所をご利用いただけます。\n※「冒険者の便利ツール専用ふくびき所」もございます。\n\n------------------------\n\n\n≪ご注意≫\n\n※プレミアムコンシェルジュ機能をご利用の際には『ドラゴンクエストⅩ　冒険者のおでかけ便利ツール』上でのみ使用できる仮想通貨「ジェム」が必要となります。\n\n※ジェムはアプリ内のショップよりお買い求めいただけますが、初回サービスとして500ジェムをご利用のアカウント毎にプレゼントしております。また、毎日おでかけ便利ツールを起動するたびにもらえるデイリーボーナスもご用意しておりますので、無料でプレミアムコンシェルジュ機能をお使いいただくことも可能です。\n\n\n■お客様へのお願い\nお客様が「ドラゴンクエストⅩ」をよりお楽しみいただけるよう、本アプリの品質向上に努めておりますが、特定の端末でのみ発生する固有の不具合など原因調査が難しいものも多く、改善のためにお客様からの情報提供を必要としております。\n\nレビュー等の内容では原因特定に至らない場合も多いので、もし不具合が見つかりました際には、ぜひとも弊社サポートセンターまで詳細情報をご提供いただけますと幸いです。\n\n※アプリに関しての不具合やお問い合わせは\n　下記URLもしくはアプリ内からお問い合わせください。\n　スクウェア・エニックスサポートセンター\n　http://support.jp.square-enix.com/main.php?la=0&id=7901\n\n【使い方】 \n本アプリをご利用になるためには、「ドラゴンクエストⅩ　目覚めし五つの種族　オンライン」をオンラインモードでプレイしている「スクウェア・エニックス　アカウント」が必要です。 \n\nアプリを起動した後に、「はじめる」→「新しくキャラクターを登録」をお選びいただき、「スクウェア・エニックス　アカウント」を入力の上、「おでかけ便利ツール」に登録したいキャラクターを選択してください。 \n\n\n【ご注意】 \nおでかけ便利ツールに登録できるキャラクターは1キャラクターです。ただし複数キャラクターをお使いの方も、登録キャラクターを変更することで、おでかけ便利ツールをお使いいただけます。 \n　 \n登録しているキャラクターの変更をするためには、画面右上にある 「編集」ボタンを押し、キャラクター削除した後に再度キャラクター登録を行ってください。 \n\nまとめて複数キャラクターを登録しておきたい方のために、キャラクター登録チケットをアプリ内で販売いたします。一度このチケットをご購入いただければ、登録可能キャラクター数を最大限の10キャラクターまで増やせます。 \n\n【対応機種】 \niOS 5以上の機種 \n\n※OSのバージョンが古い場合、 \n　 正常に動作しない場合があります。 \n\n\n【非推奨機種】 \niPhone3GS \n\n※アプリが動かなくなった場合 \n　 バックグラウンドで起動しているアプリを \n　 完全に終了させて再度起動してください。 \n　 (操作方法についてはご使用の端末の \n　　マニュアル等をご参照ください。）', '2013-07-27 02:34:53', '2014-06-04 15:04:59')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
