Error - 2014-06-04 15:05:05 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('443904275', 'JP', 'jp.naver.line', 'LINE', 'http://a1314.phobos.apple.com/us/r30/Purple/v4/35/65/3b/35653b8e-3478-dcb0-51bc-9083d3473566/mzl.ounkyxry.53x53-50.png', 'http://a1830.phobos.apple.com/us/r30/Purple/v4/35/65/3b/35653b8e-3478-dcb0-51bc-9083d3473566/mzl.ounkyxry.75x75-65.png', 'http://a1715.phobos.apple.com/us/r30/Purple/v4/35/65/3b/35653b8e-3478-dcb0-51bc-9083d3473566/mzl.ounkyxry.100x100-75.png', '0.00000', 'JPY', 'NAVER JAPAN', 'iOS_Apps', '6005', 'topgrossingipadapplications', 0, '無料通話・無料メールアプリの決定版\n\nLINEは、24時間、いつでも、どこでも、無料で好きなだけ通話やメールが楽しめる新しいコミュニケーションアプリです。\n\n世界231ヶ国、登録ユーザー数4億5千万人突破! \n\n日本、タイ、台湾、スペイン、中国、インドネシア、シンガポール、香港、マレーシア、インド、スイス、サウジアラビア、メキシコ、ロシア、マカオ、アラブ首長国連邦など、世界52ヶ国のApp Storeで無料1位を記録!\n\n\n【LINEの新機能】\n\n◆ビデオ通話\n遠く離れた家族や友人との会話やビジネスミーティングに便利な「ビデオ通話」ができるようになりました。\n\n◆Snap Movie\nその瞬間をひとコマ動画で撮影して、BGMもつけて共有できる「Snap Movie」機能を追加しました。\n\n\n【LINEの主な特徴 】 \n\n◆スマホ同士なら、いつでも、どこでも無料の音声＆ビデオ通話\n・クリアな音声品質で好きなだけ長電話をしても無料です。\n・国際電話ももちろん無料！ \n\n◆サクサク簡単すぐ届く無料メール \n友だちとメールがわりに、サークルの仲間とMLがわりに。テキストだけでなく、絵文字や写真、地図も送れます。 \n・気持ちが伝わるスタンプ・絵文字を搭載 \n・動画や音声メッセージも簡単送信可能 \n・PCにも対応 \n\n◆より楽しく・便利に コミュニケーション \nタイムラインで、テキスト・写真・動画・スタンプ・位置情報などを使って、自分の近況をアップしたり、友だちの投稿をチェックできます。\n\n◆「スタンプショップ」でお気に入りを見つけよう！\n世界の人気キャラクターや、ちょっと笑えるシュールなキャラクターなど、表情豊かなスタンプを購入できます。\n\n◆便利な情報が届く「LINE公式アカウント」 \n「友だち」に追加するだけで、国内外の人気有名人からのメッセージや、企業からのお得なお知らせ･クーポンなどが届きます。\n\n\n※パケット通信料金がかかりますのでパケット定額サービスへの加入をおすすめします。\n\n【推奨環境変更のお知らせ】 \nLINE最新バージョン（3.1.3）から、LINEの推奨環境が変わりました。 \n\n- iPhone 3GS 以上 \n- iOS 4.3 以上 \n\nアプリのバージョンアップまたはLINEの新規インストールは上記の推奨環境で行ってください。 \n\nなお、古いバージョンのiOSのままiPhoneを使っている方は、最新版へのOSのバージョンアップをおすすめします。 \n\n▼iOSのバージョンアップ方法はこちら \nhttp://mb.softbank.jp/mb/iphone/support/os_update/how_to_update/ \n（ソフトバンク・KDDIどちらも同じ方法です）', '2011-06-21 16:00:00', '2014-06-04 15:05:05')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-04 15:05:07 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('325468127', 'JP', 'jp.co.kgc.oneswingiphone.rikagaku5', '岩波理化学辞典第5版【岩波書店】(ONESWING)', 'http://a30.phobos.apple.com/us/r30/Purple4/v4/07/29/69/072969e2-fbb1-c02f-2d2c-268fccfc74c3/mzl.fcyojdfg.53x53-50.png', 'http://a546.phobos.apple.com/us/r30/Purple4/v4/07/29/69/072969e2-fbb1-c02f-2d2c-268fccfc74c3/mzl.fcyojdfg.75x75-65.png', 'http://a1007.phobos.apple.com/us/r30/Purple4/v4/07/29/69/072969e2-fbb1-c02f-2d2c-268fccfc74c3/mzl.fcyojdfg.100x100-75.png', '12400.00000', 'JPY', 'Keisokugiken Corporation', 'iOS_Apps', '6006', 'topgrossingipadapplications', 0, '●伝統と信頼の理工系辞典の決定版\n長倉三郎 井口洋夫 江沢洋  岩村秀 佐藤文隆  久保亮五 編集\n\n物理学と化学を中心に,天文学・地球物理学・地質学・鉱物学・気象学・海洋学・数学・情報科学・生物学・薬学・工学まで,幅広い分野をカバーする理工系CD-ROM辞典の内容を,そのままiPhone/iPod touchでご利用いただけます。\n\n約22,000項目の用語・人名の検索はもちろん,化学式の検索もできます.和文・欧(英・仏・独)文・ロシア語・化学式索引も付いています.\n\n\n●豊富な検索機能と超高速「全文検索」\n「EPWING」の検索機能と圧縮技術を継承し、超高速な「全文検索」を実現した新電子辞書規格「ONESWING」を採用。\n複数の語句に関し、辞書を圧縮形式のままで、照合・伸長・置換することで、超高速な「全文検索」を行い、辞書のさまざまな情報を120%活用できます。\nもちろん、「見出し語検索」には、前方一致、後方一致、部分一致、完全一致のバリエーションを装備。\nさらに、「複合検索」では、画面のフォームに従い、入力・選択することで、複雑な検索を簡単に行うことができます。辞書を体系的に閲覧できる「メニュー検索」も可能です。 \n\n・見出し語検索\n 約22,000項目の用語・人名の検索ができます。英語・仏語・独語・ロシア語による検索も可能です。\n\n・化学式検索 (複合検索)\n 約2,200個の化学式の検索ができます。\n\n・和文索引・欧(英・仏・独)文索引・ロシア語索引 (メニュー検索)\n\n・和文、欧文、ロシア語の3種類の索引を用意しました。\n\n・欧文・ロシア語には日本語表記もついているので、欧文科学用語辞典としてもご利用いただけます。\n\n・化学式索引 (メニュー検索)\n 化学式索引、化学式索引(逆引き)、化学物質名索引の3種類の索引を用意しました。\n\n・付録 (メニュー検索)\n 好評の『岩波 理化学辞典 第5版』の充実した付録も収めてあります。\n\n\n■「辞書を引く」操作をサポートするユーザ・インターフェイス\n辞書を使う人の思考を断ち切らないユーザ・インターフェースを目指しました。 \nより少ないタッチで思い通りの検索が行なえるユーザ・インターフェースで、収録された辞書をフル活用していただけます。\n\n◎ご購入に際しては必ず利用許諾をご参照願います。', '2009-08-12 18:08:16', '2014-06-04 15:05:07')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
