Error - 2014-06-04 15:05:26 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('593042008', 'JP', 'com.teamlabbody', 'teamLabBody-3D Motion Human Anatomy-', 'http://a15.phobos.apple.com/us/r30/Purple4/v4/5f/17/e4/5f17e477-2012-1142-b341-5a7c862ebce1/mzl.fwmsncys.53x53-50.png', 'http://a531.phobos.apple.com/us/r30/Purple4/v4/5f/17/e4/5f17e477-2012-1142-b341-5a7c862ebce1/mzl.fwmsncys.75x75-65.png', 'http://a848.phobos.apple.com/us/r30/Purple4/v4/5f/17/e4/5f17e477-2012-1142-b341-5a7c862ebce1/mzl.fwmsncys.100x100-75.png', '3000.00000', 'JPY', 'TEAMLABBODY.inc', 'iOS_Apps', '6020', 'topgrossingipadapplications', 0, 'teamLabBody-3D Motion Human Anatomy-は、世界で初めて、生きた人間の動き・形態を再現した3D人体解剖学アプリです。\n＊iPad2、新型iPad、iPad4、iPad miniに対応（iPad1には非対応）\n＊日本語と英語に対応\n\n-特徴-\n●世界で初めて、献体とは異なる生きた人間の関節の動きを３Ｄで再現\n骨格の動き・形態を好きな角度・倍率で閲覧できます\n\n●ＣＴやＭＲＩのデータから忠実に再現された３Ｄ人体模型\n忠実に再現された全身の筋肉・じん帯・神経・血管・骨が閲覧できます\n総対象部位数は827部位\n＊内臓と脳は含まれておりません\n\n●全身表示から直感的に操作\n全身表示の状態から見たい部分だけを自由に見れるので、非常に理解しやすく、人体解剖の学習・患者様への説明に役立ちます\n\n●1000近くの対象部位を即座に検索・表示\n検索した部位名を即座に表示し、詳細説明を閲覧できます\n\n-開発ストーリー-\n大阪大学運動器バイオマテリアル学、整形外科教授の菅本一臣の研究チームは、整形外科疾患の治療過程で世界で初めて、生きた人間の関節の三次元的な動きを解析する手法を1998年に開発。\nそこで、人間が自分の意思で動かした関節の動きは、従来の医学教科書に記載されている献体を用いた動きとは異なることを明らかにした。\n20-30名の研究協力者を募り、生きている人間で10年以上にわたり、全ての関節の形態や動きをCTやMRIで撮影し、静止イメージ画像をコンピュータプログラミングによって解析した上で、全身の筋肉・神経・血管・骨・関節をビジュアル化した。\n\n-利用シーン-\nteamLabBodyは、医療を学ぶ学生をはじめ、整形外科医・理学療法士・作業療法士・鍼灸師・柔道整復師・トレーナーなど人体と密接に関わる仕事をされる方々に幅広く利用して頂けます。\n\n●実用的な人体解剖学・運動学的知識を習得できます\nteamLabBodyは、生きた人間の動き・形態を3Dで閲覧し、詳細説明を読むことができます。人体解剖・運動学的知識の習得に役立ちます。\n\n●臨床（診療・治療計画立案等）や実際の手術計画に役立ちます\n整形外科医、理学療法士および作業療法士の方は、臨床（診療・治療計画立案等）に役立たせることができます。\nまた、筋肉だけでなく、筋肉の後ろにある大事な神経の存在等を簡単に把握できるため、実際の手術計画等にも役立ちます。オフラインで使用できるので、端末機器に清潔処理を施せば、術中活用も可能となります。\n\n●診療の際、患者様に分かりやすく説明できます\n操作方法が簡単で、3Dで閲覧でき一般の方にも非常に理解しやすいため、診療時の患者様への説明を分かりやすく行うことができます。\n\n\n-機能-\n●3D人体解剖図モード\n　・筋肉/じん帯/神経/血管/骨をそれぞれ表示/半透明/非表示で切り替え\n　・表面から段階的に表示/非表示をスライドバーで切り替え\n　・選択した部位をひとつずつ表示/半透明/非表示で切り替え\n　・検索（部位名、部位名の詳細説明、検索履歴から検索）\n　・お気に入り登録\n　・部位の詳細説明にメモの追加\n　・画面キャプチャの印刷\n　・半身切り替え（筋肉/じん帯/神経/血管をの表示を右半身/左半身で切り替え）\n\n●骨格モーションモード\n　・主要な関節の動きを閲覧\n　＊各関節の動きは複数パターン閲覧できます', '2013-03-20 23:56:45', '2014-06-04 15:05:26')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
